init = function (deviceready) {
    if(Luts.cordova && !deviceready)
        return;

    if(!Luts.cordova)
        initGa();

    Luts.Store.init(Luts.Name,Luts.TEMP_STORE);

    Luts.Upgrades.init();
    Luts.Shop.init();

    Luts.quality = new Luts.Setting('quality',Luts.cordova ? 0.5 : 1,'Quality');

    Luts.webglBefore = Luts.Store.getItem('webglBefore',false);
    this.webgl = new Luts.Setting('webgl', !Luts.cordova, 'Use WebGL (Requires Restart)','Switch this if you have performance issues');
    if(Luts.Store.getItem('webglFailed'))
        this.webgl.set(false);
    Luts.Store.setItem('webglFailed',true);

    if(this.webgl.value){
        if(!Luts.webglBefore)
            Luts.webglChanged = true;
    }
    Luts.Store.setItem('webglBefore',this.webgl.value);

    Luts.numberFormat = new Luts.Setting('numberformat', false, 'Use Engineering Notation');
    new Luts.Setting('shortMagnitude', false,'Shorten Magnitude');
    new Luts.Setting('runInBackground', !Luts.cordova,'Run in Background','When deactivated, you will get the offline income when you resume the game');

    Luts.Store.sync();

    var game = new Phaser.Game(Luts.GAME_WIDTH, Luts.GAME_HEIGHT, (this.webgl.value) ? Phaser.AUTO : Phaser.CANVAS,null,null,false,true);

    game.state.add('Boot', Luts.State.Boot);
    game.state.add('Preloader', Luts.State.Preloader);
    game.state.add('Menu', Luts.State.Menu);
    game.state.add('Credits', Luts.State.Credits);
    game.state.add('Settings', Luts.State.Settings);
    game.state.add('LevelSelection', Luts.State.LevelSelection);
    game.state.add('Game', Luts.State.Game);

    if(Luts.cordova)
        cordovaInit();

    Luts.Connect.CrazyGames();
    Luts.Ad.init();
    //Luts.Facebook.init();
    //Luts.Ad.requestAd();
    Luts.Connect.Kongregate(function(){
        Luts.Connect.Store(function () {
            game.state.start('Boot');
        }.bind(this));
    }.bind(this));
};

if ('serviceWorker' in navigator && Luts.release && !Luts.isLocal) {
    if (!Luts.isKong && !Luts.isCG) {
        navigator.serviceWorker.register('service-worker.js').then(function (reg) {
            Luts.reg = reg;
            reg.onupdatefound = function () {
                var installingWorker = reg.installing;
                installingWorker.onstatechange = function () {
                    switch (installingWorker.state) {
                        case 'installed':
                            if (navigator.serviceWorker.controller) {
                                Luts.newContent = true;
                                console.log('New or updated content is available.');
                            } else {
                                console.log('Content is now available offline!');
                            }
                            break;

                        case 'redundant':
                            //console.error('The installing service worker became redundant.');
                            break;
                    }
                };
            };
        }).catch(function (e) {
            console.error('Error during service worker registration:', e);
        });
    }else{
    }
}

if(Luts.DEBUG && Luts.cordova) {
    window.onerror = function myErrorHandler(errorMsg, url, lineNumber, col, errObj) {
        if(errObj){
            alert(errorMsg + ': ' + errObj.stack);
        }else {
            alert("Error occured: " + errorMsg);//or any message
        }
        return false;
    };
}


document.addEventListener("deviceready", onDeviceReady, false);

