Luts.State.Boot.prototype.init = function () {
    this.game.input.maxPointers = 1;
    this.game.stage.disableVisibilityChange = this.game.device.desktop;
    if ((!this.game.device.desktop || Luts.release) && !Luts.isKong) {
        this.scale.scaleMode = Phaser.ScaleManager.USER_SCALE;
        this.scale.setResizeCallback(this.resizeCallback,this);

        if (Luts.release && Luts.fullscreen) {
            document.documentElement.onclick = function () {
                this.game.scale.startFullScreen();
            }.bind(this);
        }

    } else {
        this.scale.scaleMode = Phaser.ScaleManager.SHOW_ALL;
    }

    this.game.time.advancedTiming = true;

    Luts.Events.onMouseWheel = new Phaser.Signal();
    this.game.input.mouse.mouseWheelCallback = function (delta) {
        Luts.Events.onMouseWheel.dispatch(delta.deltaY);
        return false;
    };
    document.addEventListener('mousewheel',function(e){e.preventDefault(); return false;},{passive:false});
    //document.onmousewheel = function(){return false;};

    document.documentElement.onclick = function () {
        window.focus();
    }.bind(this);

    Luts.Events.onActive = new Phaser.Signal();
    Luts.Events.onInactive = new Phaser.Signal();
};

Luts.State.Boot.prototype.resizeCallback = function(manager, bounds, force){
    if (force || manager.width != window.innerWidth || manager.height != window.innerHeight) {
        var maxScale_x = Luts.MAX_WIDTH / Luts.GAME_WIDTH;
        var maxScale_y = Luts.MAX_HEIGHT/ Luts.GAME_HEIGHT;

        var scale_x = window.innerWidth / Luts.GAME_WIDTH;
        var scale_y = window.innerHeight / Luts.GAME_HEIGHT;


        var maxRatio = (this.game.device.desktop ? 2 : window.devicePixelRatio) / (Math.max(scale_x,scale_y));
        var ratio = Math.min(maxRatio,this.game.device.desktop ? 2 : window.devicePixelRatio);
        if(Luts.cordova)
            ratio = Math.min(ratio,maxScale_x/scale_x,maxScale_y/scale_y);
        ratio *= Luts.quality.value / 2 + 0.5;
        manager.setGameSize(Luts.GAME_WIDTH * scale_x * ratio, Luts.GAME_HEIGHT * scale_y * ratio);
        manager.setUserScale(1/ratio);
        this.game.state.resize(scale_x,scale_y);
    }
};

