Luts.State.Game.prototype.sl = function(){
    new Luts.Object.Popup(this,'The game is not available on this site. Please play on Kongregate',false,function(){
        this.sl();
        window.open("https://www.kongregate.com/games/Luts91/idle-dice", Luts.cordova ? '_system' : null);
    }.bind(this));
};

Luts.State.Game.prototype.switchDuel = function(){
    this.duelVisible = !this.duelVisible;
    this.gameGroup.visible = true;
    this.botUI.visible = true;
    this.diceContainers[0].matchContainer.visible = true;
    this.duelGroup.visible = true;
    this.duelBotUI.visible = true;

    var tw = this.game.add.tween(this.gameGroup).to({alpha: this.duelVisible ? 0 : 1},500,Phaser.Easing.Linear.None,true);
    this.game.add.tween(this.botUI).to({alpha: this.duelVisible ? 0 : 1},500,Phaser.Easing.Linear.None,true);
    this.game.add.tween(this.diceContainers[0].matchContainer).to({alpha: this.duelVisible ? 0 : 1},500,Phaser.Easing.Linear.None,true);
    this.game.add.tween(this.duelGroup).to({alpha: this.duelVisible ? 1 : 0},500,Phaser.Easing.Linear.None,true);
    this.game.add.tween(this.duelBotUI).to({alpha: this.duelVisible ? 1 : 0},500,Phaser.Easing.Linear.None,true);
    this.game.add.tween(this.background2).to({alpha: this.duelVisible ? 1 : 0},500,Phaser.Easing.Linear.None,true);


    this.duelButton.text.setText(this.duelVisible ? 'Back' : 'Duels');

    tw.onComplete.add(function () {
        this.gameGroup.visible = !this.duelVisible;
        this.botUI.visible = !this.duelVisible;
        this.diceContainers[0].matchContainer.visible = !this.duelVisible;
        this.duelGroup.visible = this.duelVisible;
    },this);
};

