Luts.State.Game.prototype.asyncUpdate = function(){
    if(Luts.cordova) {
        this.game.sound.mute = !Luts.isActive;
        if(Luts.webglChanged && this.webglCheck-- <= 0){
            this.webglCheck = 999;
            Luts.getSetting('webgl').set(false);
            Luts.Store.sync();
            window.location.reload(false);
        }
    }

    var wasActive = Luts.isActive;
    Luts.isActive = (new Date() - this.lastUpdateTime < 1000);

    var delta = (new Date() - this.lastAsyncUpdateTime);
    this.lastAsyncUpdateTime = new Date();

    if (wasActive && !Luts.isActive)
        Luts.Events.onInactive.dispatch();
    if (!wasActive && Luts.isActive) {
        Luts.Events.onActive.dispatch();
    }
    if(delta > 10000){
        this.handleTimeAway({sec: delta / 1000});
    }

    if (this.unlockedCards >= 52 && this.goldenCards < 52 && this.autoConvert.value)
        this.prestige2();
    if(this.goldenCards >= 52 && this.autoInvest.value) {
        this.prestige3();
        this.casinoWindow.load();
        this.casinoWindow.updateContainers();
        this.casinoWindow.resetButton.setActive(true);
        Luts.Store.setItem('skillReset',true);
    }

    this.adTime = Date.now() - this.lastAd;
    if(this.watchingAd){
        this.adButton.setActive(false);
    }else if(this.adTime > 1000 * 60 * 20 && !Luts.Ad.requested){
        this.adNum = 0;
        Luts.Store.setItem('adNum',this.adNum);
        this.resetAdMulti();
        this.adButton.text.setText('1.5x Points');
        this.adButton.setActive(true,true);
        this.adButton.subtitle.setText("Watch Ad");
    }else{
        this.adButton.setActive(this.adNum < 3);
        this.adButton.subtitle.setText(Luts.Format.Time(1000 * 60 * 20 - this.adTime));
    }

    this.adRewardHandler.update();

    if (Luts.gamePaused)
        return;

    this.rollButton.setActive(!this.animPlaying,true);

    this.rollCounter += 1 / 10;
    if (!this.animPlaying) {
        if (this.rollInterval.modValue().lessThanOrEqualTo(this.rollCounter.toExponential(4)) ) {

            if(Luts.Lock.get('autoRoll').unlocked) {
                this.roll();
                this.nextRollBar.playCompletedEffect();
            }
        }
    }else{
        if (this.rollAnim.modValue().lessThanOrEqualTo(this.rollCounter.toExponential(4))) {
            this.rollCounter = 0;
            if (this.game.rnd.frac() < Luts.Upgrades.value('rerollChance').toNumber()){
                this.rollCounter = this.rollInterval.modValue().toNumber();
            }
            this.animPlaying = false;
            if (!this.prestiging) {
                Luts.Upgrades.changeCurrency(0, this.lastScore);

                this.totalScore.set(this.totalScore.v.add(this.lastScore));
                this.prestigeScore.set(this.prestigeScore.v.add(this.lastScore));
            }
            this.setPrestigeButtonText();

            this.prestiging = false;

            this.rollHistory.push({
                score: this.lastScore,
                values: this.diceContainers[0].lastValues,
                multis: this.diceContainers[0].lastMultis,
                match: this.diceContainers[0].lastDiceMatch
            });
            if (this.rollHistory.length > 100)
                this.rollHistory.shift();
            Luts.rollHistory = this.rollHistory;
        }
    }

    this.interestCounter += 1;
    if (this.interestCounter >= this.interestInterval){
        this.interestCounter = 0;
        Luts.Upgrades.changeCurrency(0,Luts.Upgrades.currency[0].times(this.interest.modValue()));
    }

    if (this.autoUpgrade.value){
        this.autoUpgradeCounter += 1 / 10;
        if (this.autoUpgradeInterval.modValue().lessThanOrEqualTo(this.autoUpgradeCounter)){
            this.autoUpgradeCounter = 0;
            this.diceContainers.forEach(function (dc) {
                if(Luts.Lock.get('autoUpgradeAll').unlocked)
                    dc.buyAll();
                else
                    dc.buyRandom();
            }.bind(this));
        }
    }

    if(this.autoSpendLuck.value){
        this.cardsWindow.load();
        this.cardsWindow.autoLuckOrder.forEach(function (u) {
            Luts.Upgrades.upgradeMultiple(u);
        });
    }

    Luts.Events.onAsyncUpdate.dispatch();
    this.save();
};

Luts.State.Game.prototype.setPrestigeButtonText = function(){
    var c = 'red';
    if (this.getPrestigeMulti().greaterThanOrEqualTo(this.totalPrestige.v))
        c = 'green';

    this.prestigeButton.subtitle.setText(Luts.Format.Color(c) + Luts.Format.Percent(this.getPrestigeMulti(),2));
    this.prestigeButton.visible = this.getPrestigeMulti().greaterThan(0.5) || this.prestigedNum.v.greaterThan(0);
    this.prestigeText.visible = this.prestigeButton.visible;
};

Luts.State.Game.prototype.rollAll = function(){
    var total = Decimal(0);
    var values = [];
    this.diceContainers.forEach(function(d){
        total = total.add(d.rollAll());
    }.bind(this));

    this.lastScore = total;


    var prestigeGain = this.getPrestigeMulti().times(this.prestigeGain.modValue());
    if(prestigeGain.greaterThan(0)) {
        this.totalPrestige.set(this.totalPrestige.v.add(prestigeGain));
        Luts.Value.get('main0_multi').setMultiplier('prestigeMulti', this.totalPrestige.v, null);
        Luts.Value.get('main1_multi').setMultiplier('prestigeMulti', this.totalPrestige.v, null);
        Luts.Value.get('main2_multi').setMultiplier('prestigeMulti', this.totalPrestige.v, null);
        Luts.Value.get('main3_multi').setMultiplier('prestigeMulti', this.totalPrestige.v, null);
        Luts.Value.get('main4_multi').setMultiplier('prestigeMulti', this.totalPrestige.v, null);
    }
};

Luts.State.Game.prototype.update = function(){
    Luts.dcfix = true;

    if(this.game.input.activePointer.isDown)
        Luts.webglChanged = false;

    var lastTime = this.lastUpdateTime;
    this.lastUpdateTime = new Date();
    this.deltaTime = (this.lastUpdateTime - lastTime) / 1000;

    if (new Date() - this.lastAsyncUpdateTime > Luts.GAME_SPEED)
        this.asyncUpdate();

    this.cardAvailableText.visible = Luts.Upgrades.currency[1].greaterThan(0);

    Luts.Events.onUpdate.dispatch();

    var autoRoll = Luts.Lock.get('autoRoll').unlocked;
    this.nextRollBar.visible = autoRoll;
    this.nextRollText.visible = autoRoll;
    this.cardsBar.visible = autoRoll;
    this.cardsText.visible = autoRoll;
    this.cardButton.visible = autoRoll;

    if (autoRoll){
        this.rollButton.x = 140;
        this.rewardAvailableText.y = 80;
    }else{
        this.rollButton.x = 0;
        this.rewardAvailableText.y = -100;
    }

    this.nextRollBar.barText.setText(this.animPlaying ? 0 : Luts.Format.Time((this.rollInterval.modValue().toNumber() - this.rollCounter) * 1000));
    this.nextRollBar.stepTo(this.animPlaying ? 0 : this.rollCounter / this.rollInterval.modValue().toNumber(), 0.1);
    this.nextRollBar.update();

    this.cardsBar.barText.setText(this.cardsLevel.progressDivString());
    this.cardsBar.stepTo(this.cardsLevel.progressDiv(), 0.1);
    this.cardsBar.update();

    if (Luts.newContent){
        Luts.newContent = false;
        new Luts.Object.Popup(this,'New Update available, refresh now?',true,function (yes) {
            if (yes){
                window.location.reload(false);
            }
        });
    }

    if (Luts.reg && !Luts.regIntervalSet) {
        setInterval(function (){Luts.reg.update();},1000*60);
        Luts.regIntervalSet = true;
    }

    if (Luts.DEBUG) {
        this.game.debug.text(this.game.time.fps, this.game.width - 25, 20, 0);
        this.game.debug.text(Luts.Format.Time(Luts.Time.activePlaytime), this.game.width - 90, 40);
        this.game.debug.text(Luts.Format.Time(Luts.Time.passivePlaytime), this.game.width - 90, 60);
        this.game.debug.text(Luts.Format.Time(Luts.Time.currentResetActivePlaytime), this.game.width - 90, 80);
        this.game.debug.text(Luts.Format.Time(Luts.Time.currentResetPassivePlaytime), this.game.width - 90, 100);
    }

    if(!this.ratedPlaystore) {
        if(!this.playstorePopup && this.playstoreTimer++ > 60 * 60 * 15){
            this.playstorePopup = true;
            this.playstoreTimer = 0;
            new Luts.Object.Popup(this,'Do you like this game?',true,function (yes) {
                this.playstorePopup = false;
                if(yes){
                    if(this.game.device.desktop) {
                        new Luts.Object.Popup(this, 'Thank you! It would mean much to me if you rate it!');
                        this.ratedPlaystore = true;
                        Luts.Store.setItem('ratedPlaystore',true);
                    }else{
                        new Luts.Object.Popup(this, 'Thank you! It would mean much to me if you rate it! Do you want to do it now?',true,function (yes2) {
                            if(yes2){
                                this.clickPlaystore();
                            }
                        }.bind(this));
                    }
                }else{
                    new Luts.Object.Popup(this,'Please post any bugs or other concerns on the discord/reddit/forum. I try to fix it as soon as possible');
                    this.ratedPlaystore = true;
                    Luts.Store.setItem('ratedPlaystore',true);
                }
            }.bind(this))
        }
        Luts.Store.setItem('playstoreTimer', this.playstoreTimer);
    }
    if(this.starterPackCounter++ > 60 * 60 * 4 && (!this.ownsStarterpack || !this.ownsEpicpack)){
        this.starterPackCounter = -999999999999999;
        if(!this.ownsStarterpack) {
            this.starterPackButton.visible = true;
            this.starterPackButton.setActive(false);
            this.starterPackButton.setActive(true, true);
        }else if(!this.ownsEpicpack){
            this.epicPackButton.visible = true;
            this.epicPackButton.setActive(false);
            this.epicPackButton.setActive(true, true);
        }
    }
    if(this.pushCounter++ >= this.pushInterval) {
        this.pushCounter = 0;
        Luts.Push.maxIdleTime();
    }

    //document.getElementsByTagName("canvas")[0].focus();
};

