Luts.State.Game.prototype.handleTimeAway = function(timeAway,noPopup){
    var lastMoney = Luts.Upgrades.currency[0];
    timeAway.sec = Math.min(timeAway.sec,60 * 60 * 8);

    var interval = this.rollInterval.modValue().toNumber() + this.rollAnim.modValue().toNumber();
    var bonus = this.averagePerSecond().times(timeAway.sec).dividedBy(interval);
    Luts.Upgrades.changeCurrency(0,bonus);

    this.totalScore.set(this.totalScore.v.add(bonus));
    this.prestigeScore.set(this.prestigeScore.v.add(bonus));
    this.setPrestigeButtonText();

    if (timeAway.sec >= 50 && !noPopup){
        if(this.game.rnd.frac() < 0.08){
            if(!this.ownsStarterpack) {
                this.shopPopup(this.starterText,'11starter');
            }else if(!this.ownsEpicpack){
                this.shopPopup(this.epicText,'11epic');
            }
        }

        var msg = "You were gone for " + Luts.Format.Time(timeAway.sec * 1000,true) +
            " (max 8h).\nYou gained: " + Luts.Format.Decimal(Luts.Upgrades.currency[0].minus(lastMoney),true);

        new Luts.Object.Popup(this,msg);
    }
};

Luts.State.Game.prototype.averagePerSecond = function(){
    var total = Decimal(0);
    this.diceContainers.forEach(function (dc) {
        total = total.add(dc.averagePerSecond());
    });
    return total;
};

