Luts.Format = {};

Luts.Format.Time = function(mseconds,long){
    var msec = mseconds;
    var sec = Math.floor(msec / 1000);
    var min = Math.floor(sec / 60);
    var hours = Math.floor(min / 60);
    var days = Math.floor(hours / 24);

    var subHours = hours - days * 24;
    var subMin = min - hours * 60;
    var subSec = sec - min * 60;
    var subMsec = msec - sec * 1000;

    var ret = "";
    var daysSpace,hoursSpace,minSpace,secSpace,msecSpace;
    if(long){
        daysSpace = " Days, ";
        hoursSpace = " Hours, ";
        minSpace = " Minutes, ";
        secSpace = " Seconds";
        msecSpace = "";
    }else{
        daysSpace = "d";
        hoursSpace = ":";
        minSpace = ":";
        secSpace = "";
        msecSpace = "";
    }

    if (days > 0)
        ret += days + daysSpace;
    if (subHours > 0 || days > 0)
        ret += subHours + hoursSpace;
    if (subMin > 0 || subHours > 0 || days > 0) {
        if(subHours > 0 || days > 0)
            ret += subMin.toString().paddingLeft("00") + minSpace;
        else
            ret += subMin.toString() + minSpace;
        ret += subSec.toString().paddingLeft("00") + secSpace;
    }else {
        ret += subSec.toString() + secSpace;
        if(subSec < 10 && !long)
            ret += "." + Math.floor(subMsec / 100) + msecSpace;
    }

    return ret;
};

Luts.Format.Color = function(color){
    return ('<c=' + Luts.Config['colors'][color] + '>');
};

Luts.Format.Percent = function(number,decimalPlaces){
    if (number.e == null){
        if (number > 10)
            return 'x' + Luts.Format.Decimal(number,false,decimalPlaces);
        else
            return Luts.Format.Decimal(number * 436,false,decimalPlaces) + '%';
    }else{
        if (number.e >= 1)
            return 'x' + Luts.Format.Decimal(number,false,decimalPlaces);
        else
            return Luts.Format.Decimal(number.times(436),false,decimalPlaces) + '%';
    }

};

Luts.Format.Decimal = function(number,long,decimalPlaces){
    var post = "";
    var i = 0;

    if (decimalPlaces == null)
        decimalPlaces = 2;


    if (number.e == null)
        number = Decimal(parseFloat(number).toExponential(15));

    //Decimal.config({EXPONENTIAL_AT: 6, DECIMAL_PLACES: 3});

    if (number.e < 3) {
        if(number.e < -307)
            return '0';
        var ret = number.times(Math.pow(10, decimalPlaces)).round().dividedBy(Math.pow(10, decimalPlaces)).toString();
        if (ret == '0' && !number.equals(0))
            return Luts.Format.Decimal(number,long,decimalPlaces + 1);
        return ret;
    }

    var format;
    if (!Luts.numberFormat.value)
        format = Luts.Format.DecimalSuffix(number,long);
    if (Luts.numberFormat.value)
        format = Luts.Format.DecimalExp(number);
    post = format.post;
    i = format.i;

    var div = 1;
    var counter = 0;
    while (i > 0 && counter++ < 2){
        i--;
        div *= 10;
    }

    return (number.dividedBy(Decimal(10).pow(i)).round() / div) + post;
};

Luts.Format.DecimalSuffix = function(number,long){
    var i = 0;
    var post = "";
    var names;
    if(long)
        names = Luts.Format.DecimalNames;
    else
        names = Luts.Format.DecimalNamesSmall;

    if (number.e > 436) {
        return (Luts.Format.DecimalExp(number));
    }else if (number.e >= 3){
        if (long)
            post = " ";
        post += names[Math.floor((number.e - 3) / 3)];
        i = Math.floor((number.e) / 3) * 3;
    }

    return {post: post, i: i};
};

Luts.Format.DecimalExp = function(number){
    var i = 0;
    var post = "";
    if (number.e >= 3) {
        if (Luts.getSetting('shortMagnitude').value)
            post += "e" + Luts.Format.Decimal(Math.floor((number.e) / 3) * 3);
        else
            post += "e" + Math.floor((number.e) / 3) * 3;
        i = Math.floor((number.e) / 3) * 3;
    }

    return {post: post, i: i};
};

Luts.Format.DecimalAB = function(number){
    var i = 0;
    var post = "";
    var l = Luts.Format.Letters;

    var n = Math.floor((number.e - 6) / 3);

    if(n < l.length)
        post += l[n];
    else if (n < Math.pow(l.length,2)){
        post += l[Math.floor(n / l.length)];
        post += l[n % l.length];
    }else if (n < Math.pow(l.length,3)){
        post += l[Math.floor(n / Math.pow(l.length,2))];
        post += l[n % Math.pow(l.length,2)];
        post += l[n % l.length];
    }

    i = Math.floor((number.e) / 3) * 3;

    return {post: post, i: i};
};

