Luts.Value = function(name,value,displayName,marker){
    this.name = name;
    this.displayName = displayName;
    this.initialValue = value;
    this.v = Decimal(Luts.Store.getItem(name,value,true));
    this.multipliers = [];
    this.marker = marker;
    this.onChange = new Phaser.Signal();
    Luts.Value.values.push(this);
    Luts.Value.valuesIndex[this.name] = this;

    var mNames = JSON.parse(Luts.Store.getItem(name + '_m',null));
    if (mNames){
        mNames.forEach(function (m) {
            var multi = new Luts.Multiplier(m,this.name);
            this.multipliers.push(multi);
        }.bind(this))
    }
    this.save();

    this.onChange.add(function () {
        this.changed = true;
    },this);

    Luts.Events.onUnload.add(this.save,this);

    this.changed = true;
    this._modValue = this.modValue();
};

Luts.Value.values = [];
Luts.Value.valuesIndex = {};

Luts.Value.prototype.constructor = Luts.Value;

Luts.Value.saveAll = function(){
    Luts.Value.values.forEach(function(t){
        t.save();
    });
};

Luts.Value.getByName = function(name){
    var v = Luts.Value.valuesIndex[name];
    if (v)
        return v;

    for(var i = 0; i  <Luts.Value.values.length; i++){
        if ( Luts.Value.values[i].name == name)
            return Luts.Value.values[i];
    }
    return null;
};

Luts.Value.getByMarker = function(marker){
    var ret = [];
    for(var i = 0; i  <Luts.Value.values.length; i++){
        if ( Luts.Value.values[i].marker == marker)
            ret.push(Luts.Value.values[i]);
    }
    return ret;
};

Luts.Value.get = function(value){
    if (typeof (value) == 'string')
        return Luts.Value.getByName(value);
    else
        return value;
};

Luts.Value.prototype.set = function(value){
    var old = this.v;
    this.v = Decimal(value);
    if (!old.equals(Decimal(value)))
        this.onChange.dispatch();
    this.save();
};

Luts.Value.prototype.reset = function(){
    this.set(this.initialValue);
};

Luts.Value.prototype.add = function(value){
    this.set(this.v.add(value));
};

Luts.Value.prototype.save = function(){
    Luts.Store.setItem(this.name,this.v.toExponential(6));

    var mNames = [];
    for (var i = 0; i < this.multipliers.length; i++){
        mNames.push(this.multipliers[i].name);
    }
    Luts.Store.setItem(this.name + '_m',JSON.stringify(mNames));

    this.multipliers.forEach(function (value) { value.save() });
};

Luts.Value.resetAllMultipliers = function(marker){
    Luts.Value.values.forEach(function (v) {
        var changed = false;
        v.multipliers.forEach(function (m) {
            if (m.marker == marker) {
                m.value = Decimal(1);
                changed = true;
            }
        });
        if (changed)
            v.onChange.dispatch();
        v.save();
    });
};

Luts.Value.prototype.setMultiplier = function(name,value,type,marker){
    var multi;
    var changed = true;
    multi = this.getMultiplier(name);
    if (!multi) {
        multi = new Luts.Multiplier(name,this.name, value, type,marker);
        this.multipliers.push(multi);
    } else {
        if (multi.value.equals(value))
            changed = false;
    }
    multi.value = Decimal(value);
    multi.marker = marker;
    if (changed)
        this.onChange.dispatch();
    this.save();
    return multi;
};

Luts.Value.prototype.changeMultiplier = function(name,initialValue,valueIncrease,type,marker){
    var m = this.getMultiplier(name);
    if (!m){
        m = this.setMultiplier(name,initialValue,type,marker);
    }else{
        this.setMultiplier(name,m.value.add(valueIncrease),type,marker);
    }
};

Luts.Value.prototype.getMultiplier = function(name){
    for(var i = 0; i < this.multipliers.length; i++) {
        if (this.multipliers[i].name == name)
            return this.multipliers[i];
    }
    return null;
};

Luts.Value.prototype.modValue = function(){
    if (!this.changed)
        return this._modValue;

    var sum = this.v;
    for(var i = 0; i < this.multipliers.length; i++){
        var m = this.multipliers[i];
        if (m.type == 1)
            sum = sum.add(m.value);
    }
    for(i = 0; i < this.multipliers.length; i++){
        m = this.multipliers[i];
        if (m.type == 0)
            sum = sum.mul(m.value);
    }

    this._modValue = sum;
    this.changed = false;
    return sum;
};

Luts.Multiplier = function (name,prefix,value,type,marker) {
    if (type == null)
        type = 0;

    this.name = name;
    this.prefix = prefix;
    this.value = Decimal(Luts.Store.getItem(this.prefix + '_' + this.name,value,true));
    this.type = type;
    if (!marker)
        this.marker = Luts.Store.getItem(this.prefix + '_' + this.name + '_marker',marker);
};

Luts.Multiplier.prototype.constructor = Luts.Multiplier;

Luts.Multiplier.prototype.save = function () {
    Luts.Store.setItem(this.prefix + '_' + this.name,this.value.toExponential(6));
    if (this.marker)
        Luts.Store.setItem(this.prefix + '_' + this.name + '_marker',this.marker);
};


Luts.Levelable = function(name,baseCost,costIncrease,maxLevel){
    this.name = name;
    this.baseCost = baseCost;
    this.progress = new Luts.Value('la_' + name + 'Progress',0);
    this.cost = new Luts.Value('la_' + name + 'Cost',baseCost);
    this.costIncrease = costIncrease;
    this.level = new Luts.Value('la_' + name + 'Level',0);
    this.maxLevel = maxLevel;
    this.onIncreaseLevel = new Phaser.Signal();
    this.onChange = new Phaser.Signal();
};

Luts.Levelable.prototype.constructor = Luts.Levelable;

Luts.Levelable.prototype.addProgress = function(num){
    this.progress.set(this.progress.v.add(num));
    this.onChange.dispatch(this);

    while (this.progress.v.greaterThanOrEqualTo(this.cost.modValue()) && (this.maxLevel == null || this.level.v.lessThan(this.maxLevel))) {
        this.progress.set(this.progress.v.minus(this.cost.modValue()));
        this.cost.set(this.cost.v.times(this.costIncrease));
        this.level.set(this.level.v.add(1));
        this.onIncreaseLevel.dispatch(this.level.v);
    }
};

Luts.Levelable.prototype.progressDiv = function(){
    if (this.maxLevel != null && this.level.v.greaterThanOrEqualTo(this.maxLevel)) {
        return 1;
    }
    return (this.progress.v.dividedBy(this.cost.modValue()));
};

Luts.Levelable.prototype.progressDivString = function(){
    if (this.maxLevel != null && this.level.v.greaterThanOrEqualTo(this.maxLevel)) {
        return 'MAX';
    }
    return Luts.Format.Decimal(this.progress.v) + " / " + Luts.Format.Decimal(this.cost.modValue());
};

Luts.Levelable.prototype.reset = function(){
    this.level.set(Decimal(0));
    this.progress.set(Decimal(0));
    this.cost.set(Decimal(this.baseCost));
};
