Luts.Save.decrypt = function(str){
    var data;
    try{
        data = CryptoJS.AES.decrypt(str,Luts.Name).toString(CryptoJS.enc.Utf8);
        data = atob(data);
    }catch (e) {
        data = atob(str);
    }
    var parsedData = JSON.parse(data.toString());
    parsedData = Luts.Save.untrimData(parsedData);
    return parsedData;
};
Luts.Save.encrypt = function(str){
    var data = btoa(JSON.stringify(str));
    //data = CryptoJS.AES.encrypt(data,Luts.Name);
    return data;
};

Luts.Save.getTrimmedData = function(){
    Luts.Store.setItem('trimmed',1);

    Luts.Store.sync();

    var trimmedData = {};
    for(key in Luts.Storage) {
        if (typeof Luts.Storage[key] != 'function') {
            var newKey = key.replace(Luts.Name + '_', '');
            if(newKey.charAt(newKey.length - 1) != '_' && newKey.charAt(0) != '_')
                trimmedData[newKey] = Luts.Storage[key];
        }
    }
    return trimmedData;
};

Luts.Save.untrimData = function(d){
    var td = {};
    if (d['trimmed'] === "1"){
        for(key in d) {
            if (typeof d[key] != 'function') {
                var newKey = Luts.Name + '_' + key;
                td[newKey] = d[key];
            }
        }
    }else
        td = d;
    return td;
};


