Luts.Object.Tooltip = function(state, object,text) {
    Phaser.Graphics.call(this, state.game, object.x, object.y);
    state.game.add.existing(this);
    this.game = state.game;
    this.state = state;

    this.object = object;
    this.object.inputEnabled = true;
    this.object.tooltip = this;

    this.fixedToCamera = true;

    this.textFunction = null;
    this.textString = text;
    if (typeof text == 'function') {
        this.textFunction = text;
        this.textString = this.getText();
    }


    this.g = this.game.add.graphics();
    this.addChild(this.g);

    this.text = new Luts.Object.Text(this.state, 0, 0, 'text', this.textString, 20);
    this.text.wordWrapWidth = 200;
    this.addChild(this.text);

    this.g.beginFill(0x000000);
    this.g.drawRect(-5, -5, this.text.width + 10, this.text.height + 10);
    this.g.endFill();

    this.alpha = 0;

    this.isOver = false;

    this.counter = 0;
    this.maxCounter = Luts.cordova ? 120 : 1200;

    if (this.game.device.desktop) {
        object.events.onInputOver.add(function () {
            if (!(this.object.lock && !this.object.lock.unlocked)) {
                this.game.add.existing(this);
                this.isOver = true;
                this.setPosition();
            }
        }, this);
    }else{
        object.events.onInputDown.add(function () {
            if (!(this.object.lock && !this.object.lock.unlocked)) {
                this.game.add.existing(this);
                this.isOver = true;
                this.setPosition();
                this.scale.set(state.lastScale);
            }
        }, this);
    }
    object.events.onInputOut.add(function(){
        this.isOver = false;
    },this);
    object.events.onDestroy.add(function () {
        this.destroy()
    },this);
};

Luts.Object.Tooltip.prototype.constructor = Luts.Object.Tooltip;
Luts.Object.Tooltip.prototype = Object.create(Phaser.Graphics.prototype);

Luts.Object.Tooltip.prototype.update = function () {
    if (this.isOver) {
        if(!this.object.parent) {
            this.destroy();
            return;
        }
        if (!this.object.getBounds().contains(this.game.input.x,this.game.input.y))
            this.isOver = false;

        if (this.counter++ >= this.maxCounter){
            this.isOver = false;
            this.counter = 0;
        }

        this.text.setText(this.getText());
        if (this.text.hasChanged){
            this.text.hasChanged = false;
            this.resizeBackground();
        }
        this.alpha += (1 - this.alpha) * 0.04 * 60/ (this.game.time.fps || 60);
    }else {
        this.alpha += (0 - this.alpha) * 0.2 * 60/ (this.game.time.fps || 60);
        if (this.alpha < 0.01)
            this.alpha = 0;
    }


    if (this.alpha > 0)
        this.setPosition();
    this.renderable = (this.alpha > 0);
    this.visible = this.renderable;

    if (!this.visible){
       this.game.world.remove(this);
    }
};


Luts.Object.Tooltip.prototype.preUpdate = function () {
    if(this.worldVisible)
        Phaser.Graphics.prototype.preUpdate.call(this);
};
Luts.Object.Tooltip.prototype.postUpdate = function () {
    if(this.worldVisible)
        Phaser.Graphics.prototype.postUpdate.call(this);
};
Luts.Object.Tooltip.prototype._renderCanvas = function (arg) {
    if(this.worldVisible)
        Phaser.Graphics.prototype._renderCanvas.call(this,arg);
};
Luts.Object.Tooltip.prototype._renderWebGL = function (arg) {
    if(this.worldVisible)
        Phaser.Graphics.prototype._renderWebGL.call(this,arg);
};

Luts.Object.Tooltip.prototype.setPosition = function(){
    var scale = Math.min(this.game.height / Luts.GAME_HEIGHT, this.game.width / Luts.GAME_WIDTH);
    var x;
    var y = this.game.input.y;

    if(this.object.world.x > this.game.width / 2){
        x = (this.object.world.x - this.object.offsetX * scale) - this.text.width * scale;
    } else{
        x = this.object.world.x + (this.object.width - this.object.offsetX) * scale;
    }

    this.cameraOffset.set(x,y);
};

Luts.Object.Tooltip.prototype.getText = function () {
    if (this.textFunction != null)
        return this.textFunction();
    else
        return this.textString;
};

Luts.Object.Tooltip.prototype.setText = function(text){
    this.textString = text;
    if (typeof text == 'function'){
        this.textFunction = text;
        this.textString = this.getText();
    }
};

Luts.Object.Tooltip.prototype.resizeBackground = function(){
    this.g.clear();
    this.g.beginFill(0x000000);
    this.g.drawRect(-5,-5, this.text.width + 10, this.text.height + 10);
    this.g.endFill();
};
