Luts.Object.Slider.prototype.constructor = Luts.Object.Slider;
Luts.Object.Slider.prototype = Object.create(Phaser.Image.prototype);

Luts.Object.Slider.prototype.update = function () {
    if (this.worldVisible){
        if (!this.state.input.activePointer.isDown)
            this.isDown = false;
        if (this.isDown){
            this.knob.x = this.toLocal(new Phaser.Point(this.state.input.x,0)).x;
            this.knob.x = Phaser.Math.clamp(this.knob.x,0,this.width);
            this.value = this.knob.x / this.width;
        }
        if (this.wasDown && !this.isDown){
            this.onChange.dispatch(this.value);
        }
        this.wasDown = this.isDown;
    }
};
