Luts.Object.SettingsWindow.prototype.constructor = Luts.Object.SettingsWindow;
Luts.Object.SettingsWindow.prototype = Object.create(Luts.Object.Window.prototype);

Luts.Object.SettingsWindow.prototype.update = function () {
    if (this.shown)
        this.scroll.update();
};

Luts.Object.SettingsWindow.prototype.createSettingEntry = function(setting,x,y){
    var text = new Luts.Object.Text(this.state,x ,y ,'text',setting.description + ':',16,'#000000');
    text.strokeThickness = 0;
    this.scroll.addToScrollGroup(text);

    if (setting.longDescription) {
        new Luts.Object.Tooltip(this.state,text,setting.longDescription);
    }

    if(setting.value === true || setting.value === false){
        this.createToggleButton(setting, x, y);
    }
    if(typeof (setting.value) === 'number'){
        this.createSlider(setting,x,y);
    }

    setting.onChanged.dispatch(setting);
};

Luts.Object.SettingsWindow.prototype.createSlider = function(setting,x,y){
    var slider = new Luts.Object.Slider(this.state,x + 285,y + 10,setting.value);
    slider.setting = setting;
    this.scroll.addToScrollGroup(slider);

    slider.onChange.add(function (value) {
        setting.set(value);
    });
};

Luts.Object.SettingsWindow.prototype.createToggleButton = function(setting,x,y){
    var button = new Luts.Object.Button(this.state,x + 310,y + 10,'','',this.settingClicked);
    button.setting = setting;
    this.scroll.addToScrollGroup(button);

    setting.onChanged.add(function (changedSetting) {
        if (changedSetting.value)
            this.setFrames('settings_enabled','settings_enabled');
        else
            this.setFrames('settings_disabled','settings_disabled');
    }.bind(button));

    if (setting.name == 'autoAscend')
        button.setLock('autoAscend');
    if (setting.name == 'autoSpin')
        button.setLock('autoSpin');
    if (setting.name == 'autoRouletteUpgrade')
        button.setLock('autoRouletteUpgrade');
    if (setting.name == 'autoRouletteFocus')
        button.setLock('autoRouletteFocus');
    if (setting.name == 'autoDraw')
        button.setLock('autoDraw');
    if (setting.name == 'autoGild')
        button.setLock('autoGild');
    if (setting.name == 'focusOnCard')
        button.setLock('roulette');
    if (setting.name == 'autoConvert')
        button.setLock('autoConvert');
    if (setting.name == 'autoUpgrade')
        button.setLock('autoUpgrade');
    if (setting.name == 'autoSlotSpin')
        button.setLock('autoSlotSpin');
    if (setting.name == 'autoRoulettePrestige')
        button.setLock('autoRoulettePrestige');
    if (setting.name == 'autoInvest')
        button.setLock('autoInvest');
    if (setting.name == 'slotFill')
        button.setLock('slotFill');
    if (setting.name == 'autoSpendLuck')
        button.setLock('autoLuck');
};



Luts.Object.SettingsWindow.prototype.settingClicked = function () {
    this.setting.toggle();
};

