Luts.Object.CardsWindow.prototype.constructor = Luts.Object.CardsWindow;
Luts.Object.CardsWindow.prototype = Object.create(Luts.Object.Window.prototype);

Luts.Object.CardsWindow.prototype.updateAutoDrawCards = function(){
    this.autoDrawCards.forEach(function (c,i) {
        c.setType(this.autoDrawOrder[i],c.type2);
        c.updateArrows();
    }.bind(this));
    this.autoGildCards.forEach(function (c,i) {
        c.setType(this.autoGildOrder[i],c.type2);
        c.updateArrows();
    }.bind(this));
    this.saveAutoDraw();
};

Luts.Object.CardsWindow.prototype.updateAutoLuckTexts = function(){
    this.autoLuckTexts.forEach(function (c,i) {
        c.updateData(this.autoLuckOrder[i]);
        c.updateArrows();
    }.bind(this));
    this.saveAutoLuck();
};

Luts.Object.CardsWindow.prototype.watchAd = function(){
    new Luts.Object.Popup(this.state,'Are you sure to reshuffle the cards for 2 Bonus Points?',true,function (yes) {
        if (yes) {
            if(Luts.Upgrades.currency[6].greaterThanOrEqualTo(2)){
                Luts.Upgrades.changeCurrency(6,-2);
                this.randomizeCards();
            } else if (Luts.mtxEnabled && Luts.Connect.kong){
                new Luts.Object.Popup(this.state,'You dont have enough Bonus Points. Do you want to get more?',true,function (yes) {
                    if (yes) {
                        this.state.mtxClicked();
                    }
                }.bind(this));
            } else {
                new Luts.Object.Popup(this.state,'You dont have enough Bonus Points. Check in daily and unlock achievements to get more BP');
            }
        }
    }.bind(this));
};

Luts.Object.CardsWindow.prototype.saveAutoDraw = function(){
    Luts.Store.setItem('autoDrawOrder',JSON.stringify(this.autoDrawOrder));
    Luts.Store.setItem('autoGildOrder',JSON.stringify(this.autoGildOrder));
};

Luts.Object.CardsWindow.prototype.saveAutoLuck = function(){
    Luts.Store.setItem('autoLuckOrder',JSON.stringify(this.autoLuckOrder));
};

Luts.Object.CardsWindow.prototype.update = function () {
};

Luts.Object.CardsWindow.prototype.gild = function(){
    this.state.goldCardsWindow.toggle();
};
Luts.Object.CardsWindow.prototype.casinos = function(){
    this.state.casinoWindow.toggle();
};

Luts.Object.CardsWindow.prototype.convert = function(){
    var luckPoints = this.state.totalPrestige.v.add(this.state.getPrestigeMulti()).times(this.state.luckMulti.modValue());
    this.convertButton.setActive(false);

    new Luts.Object.Popup(this.state,Luts.Format.Color('red') + 'You will lose your upgrades and your prestige multiplier will reset to 0. You will be able to chose a golden card (which will stay after you prestige) and get '+ Luts.Format.Decimal(luckPoints) +' luck with that you can buy special upgrades. Are you sure to reset everything?',true,function (yes) {
        this.convertButton.setActive(true);
        if (yes){
            this.state.prestige2();
        }
    }.bind(this));
};

Luts.Object.CardsWindow.prototype.randomizeCards = function(){
    if (this.reshuffleButton) {
        this.reshuffleButton.setActive(false);
        this.reshuffleButton.setActive(true, true);
    }

    if (this.state.unlockedCards < 52)
        this.cardDrawable1.randomType(0);
    if (this.state.unlockedCards < 51)
        this.cardDrawable2.randomType(1,this.cardDrawable1.ctype);
    if (this.state.unlockedCards < 50)
        this.cardDrawable3.randomType(2,this.cardDrawable1.ctype,this.cardDrawable2.ctype);

    this.cardDrawable1.visible = this.state.unlockedCards < 52;
    this.cardDrawable2.visible = this.state.unlockedCards < 51;
    this.cardDrawable3.visible = this.state.unlockedCards < 50;

    if (Luts.Object.AchievementsHandler.unlockedCardTypeNum(this.cardDrawable3.ctype)>=4)
        this.cardDrawable3.visible = false;
    if (Luts.Object.AchievementsHandler.unlockedCardTypeNum(this.cardDrawable2.ctype)>=4)
        this.cardDrawable2.visible = false;

    this.cdContainer1.scale.set(1);
    this.cdContainer2.scale.set(1);
    this.cdContainer3.scale.set(1);

    this.game.add.tween(this.cdContainer1.scale).from({x: 0},500,Phaser.Easing.Back.Out,true);
    this.game.add.tween(this.cdContainer2.scale).from({x: 0},500,Phaser.Easing.Back.Out,true);
    this.game.add.tween(this.cdContainer3.scale).from({x: 0},500,Phaser.Easing.Back.Out,true);

    this.desc1.visible = this.cardDrawable1.visible;
    this.desc2.visible = this.cardDrawable2.visible;
    this.desc3.visible = this.cardDrawable3.visible;
};

Luts.Object.CardsWindow.prototype.autoDraw = function () {
    if (this.state.autoDraw.value) {
        this.autoDrawOrder.forEach(function (t) {
            if (this.cardDrawable1.visible && this.cardDrawable1.ctype == t) {
                this.cardDrawable1.clickCard();
                return;
            }
            if (this.cardDrawable2.visible && this.cardDrawable2.ctype == t) {
                this.cardDrawable2.clickCard();
                return;
            }
            if (this.cardDrawable3.visible && this.cardDrawable3.ctype == t) {
                this.cardDrawable3.clickCard();
                return;
            }
        }.bind(this));
    }
};

Luts.Object.CardsWindow.prototype.autoGild = function () {
    if (this.state.autoGild.value){
        var types2 = ['caro','cross','heart','pik'];
        this.autoGildOrder.forEach(function (t) {
            types2.forEach(function (t2) {
                var u = Luts.Upgrades.get(t2 + t + '_gold');
                if (u.level == 0){
                    Luts.Upgrades.upgrade(u);
                    this.state.luckMulti.changeMultiplier('luckPerGold',1,Luts.Upgrades.value('luckPerGold'),null,'prestige3');
                }
            }.bind(this));
        }.bind(this));
    }

    Luts.Events.onDrawCard.dispatch();
};
Luts.Object.HistoryWindow = function(state){
    Luts.Object.Window.call(this, state,'Roll History',function () {

        this.scroll = new Luts.Object.Scrollable(state,10,70,this.rWidth - 30,this.rHeight - 90);
        this.addChild(this.scroll);
        this.swapChildren(this.scroll,this.closeButton);

        this.scrollIndex = 0;
        this.texts = [];

        this.updateCounter = 0;
        this.updateInterval = 30;

        for(var i = 0; i < 100; i++){
            this.addStatistic(function (i) {
                var d = this.state.rollHistory[i];
                if (d) {
                    return {
                        values: d.values,
                        multis: 'x' + Luts.Format.Decimal(d.multis),
                        combo: d.match,
                        points: d.score
                    };
                }else{
                    return{
                        values: '',
                        multis: '',
                        combo: '',
                        points: ''
                    }
                }
            }.bind(this));
        }

        this.min = Decimal(0);
        this.max = Decimal(0);
    }.bind(this));
};

Luts.Object.HistoryWindow.prototype.constructor = Luts.Object.HistoryWindow;
Luts.Object.HistoryWindow.prototype = Object.create(Luts.Object.Window.prototype);

Luts.Object.HistoryWindow.prototype.update = function () {
    if (!this.shown)
        return;

    if (this.updateCounter++>this.updateInterval) {
        this.updateCounter = 0;

        if(this.state.rollHistory.length <= 0)
            return;

        this.min = this.state.rollHistory[0].score;
        this.max = this.state.rollHistory[0].score;
        for(var j = 1; j < this.state.rollHistory.length; j++){
            if (this.min.greaterThan(this.state.rollHistory[j].score))
                this.min = this.state.rollHistory[j].score;
            if (this.max.lessThan(this.state.rollHistory[j].score))
                this.max = this.state.rollHistory[j].score;
        }

        this.texts.forEach(function (t,i) {
            if (t.assignFunction)
                var newText = t.assignFunction(this.state.rollHistory.length-i);
            if (newText.values != '') {
                t.values.text = newText.values;
                t.multis.text = newText.multis;
                t.combo.text = Luts.DiceRules.getData(newText.combo).name;
                t.score.text = Luts.Format.Decimal(newText.points);
                var cPos = newText.points.minus(this.min).div(this.max.minus(this.min)).sqrt().times(10000);
                t.score.tint = Phaser.Color.interpolateColor(0x000000,0xFF66D2,10000,cPos,1);
            }
        }.bind(this));
    }

    this.scroll.update();
};

Luts.Object.HistoryWindow.prototype.addStatistic = function(assignFunction){
    var container = this.game.add.image(0,this.scrollIndex*20);

    container.values = new Luts.Object.Text(this.state,10,0,'text','',20,'#000000');
    container.multis = new Luts.Object.Text(this.state,300,0,'text','',20,'#000000');
    container.score = new Luts.Object.Text(this.state,600,0,'regular','',20,'#ffffff');
    container.combo = new Luts.Object.Text(this.state,100,0,'regular','',20,'#000000');
    container.values.strokeThickness = 0;
    container.multis.strokeThickness = 0;
    container.score.strokeThickness = 0;
    container.combo.strokeThickness = 0;

    container.addChild(container.values);
    container.addChild(container.multis);
    container.addChild(container.score);
    container.addChild(container.combo);

    container.score.anchor.set(1,0);

    this.scroll.addToScrollGroup(container);

    container.assignFunction = assignFunction;
    this.texts.push(container);

    this.scrollIndex++;
    return container;
};
