Luts.Object.AchievementsWindow.prototype.update = function () {
    if (!this.shown)
        return;
    this.tabs.tabs.forEach(function (tab) {
        if (tab.visible) {
            tab.scroll.update();
            tab.bars.forEach(function (bar) {
                if (bar.a.level == 0) {
                    bar.barText.text = Luts.Format.Decimal(bar.a.value) + '/' + Luts.Format.Decimal(bar.a.goal);
                    bar.stepTo(bar.a.value.dividedBy(bar.a.goal), 0.1);
                }else{
                    bar.barText.text = 'DONE!';
                    bar.setTo(1);
                }
                bar.update();
            }.bind(this));
        }
    }.bind(this));
};
