Luts.Object.RouletteWindow.prototype.updateButtons = function () {
    Luts.Store.setItem('betOnBlack',this.betOnBlack);
    this.blackButton.setActive(!this.betOnBlack);
    this.redButton.setActive(this.betOnBlack);

    Luts.Store.setItem('rouletteFocus',this.focus);
    this.focusNothingButton.setActive(this.focus != 'nothing');
    this.focusMultiButton.setActive(this.focus != 'multi');
    this.focusCardButton.setActive(this.focus != 'card');
    this.focusFFButton.setActive(this.focus != 'ff');
};

Luts.Object.RouletteWindow.prototype.clickSpin = function(noUpgrade){
    var upgraded = false;
    if (!noUpgrade)
        upgraded = Luts.Upgrades.upgrade(this.spin);

    if (upgraded || noUpgrade) {
        Luts.Sound.play('spin',0.5);
        Luts.Value.get('rouletteSpins').add(1);
        this.state.cardProgressMulti.changeMultiplier('cardProgressPerSpin',1,Luts.Upgrades.value('cardProgressPerSpin'),null,'prestige');
        this.spinning = true;
        this.updateText();

        this.lastReward = this.rnd.between(0, this.data.size - 1);

        if (this.rnd.frac() < Luts.Upgrades.value('focusChance')){
            var reward = (this.data.size - 1) - this.rnd.pick(this.getRewardIndexesOfFocus());
            if (!Number.isNaN(reward))
                this.lastReward = reward;
        } else if (this.focusCharge.v.greaterThan(0) && this.focus != 'nothing'){
            var reward = (this.data.size - 1) - this.rnd.pick(this.getRewardIndexesOfFocus());
            if (!Number.isNaN(reward)) {
                this.focusCharge.add(-1);
                this.lastReward = reward;
            }
        }
        Luts.Store.setItem('rouletteRng',this.rnd.state());

        this.lastRewardData = Luts.Object.RouletteRules.data(this.data.rewards[(this.data.size - 1) - this.lastReward]);
        var x = Math.sin(Math.PI * 2 * (this.lastReward + 0.5) / this.data.size) * this.rouletteSize * 0.4;
        var y = Math.cos(Math.PI * 2 * (this.lastReward + 0.5) / this.data.size) * this.rouletteSize * 0.4;
        var rotation = Phaser.Math.angleBetween(0, 0, x, y) + Math.PI / 2;
        this.roulette.rotation = rotation;
        var tw = this.game.add.tween(this.roulette).from({rotation: rotation + 10}, this.state.rouletteAnim.modValue().times(1000).toNumber(), Phaser.Easing.Sinusoidal.Out, true);
        var spinEnded = false;
        var spinEnd = function () {
            if (spinEnded)
                return;
            spinEnded = true;

            var text = this.lastRewardData.name;
            var respin = false;

            if (this.lastRewardData.icon == 'roulette_card' && this.state.unlockedCards >= 52){
                text = "Respin!";
                respin = true;
                this.clickSpin(true);
            }


            this.lastRewardData.onUpgrade();
            this.spinning = respin;
            this.updateText();

            this.rewardText.setText(text);

            var black = (this.lastReward % 2 === 0);
            if (black === this.betOnBlack)
                Luts.Upgrades.changeCurrency(4,this.state.chipMulti.modValue());

            if (Luts.isActive) {
                if (!this.worldVisible)
                    this.state.showAutoRoll(text);

                var tw2 = this.game.add.tween(this.rewardText.scale).to({
                    x: 1,
                    y: 1
                }, 1000, Phaser.Easing.Elastic.Out, true);
                var tw3 = this.game.add.tween(this.rewardText.scale).to({
                    x: 0,
                    y: 0
                }, 500, Phaser.Easing.Back.In, false);
                tw2.chain(tw3);
            }
        }.bind(this);

        setTimeout(spinEnd,this.state.rouletteAnim.modValue().times(1000).toNumber());
        tw.onComplete.add(spinEnd,this);
    }
};

Luts.Object.RouletteWindow.prototype.getRewardIndexesOfFocus = function(){
    var ret = [];
    switch (this.focus) {
        case 'nothing':
            ret = this.getRewardIndexesOfType();
            break;
        case 'multi':
            ret.push.apply(ret,this.getRewardIndexesOfType('m1x2'));
            ret.push.apply(ret,this.getRewardIndexesOfType('m2x2'));
            ret.push.apply(ret,this.getRewardIndexesOfType('m3x2'));
            ret.push.apply(ret,this.getRewardIndexesOfType('m4x2'));
            ret.push.apply(ret,this.getRewardIndexesOfType('m5x2'));
            ret.push.apply(ret,this.getRewardIndexesOfType('m1x5'));
            ret.push.apply(ret,this.getRewardIndexesOfType('m2x5'));
            ret.push.apply(ret,this.getRewardIndexesOfType('m3x5'));
            ret.push.apply(ret,this.getRewardIndexesOfType('m4x5'));
            ret.push.apply(ret,this.getRewardIndexesOfType('m5x5'));
            ret.push.apply(ret,this.getRewardIndexesOfType('m1x10'));
            ret.push.apply(ret,this.getRewardIndexesOfType('m2x10'));
            ret.push.apply(ret,this.getRewardIndexesOfType('m3x10'));
            ret.push.apply(ret,this.getRewardIndexesOfType('m4x10'));
            ret.push.apply(ret,this.getRewardIndexesOfType('m5x10'));
            break;
        case 'card':
            ret.push.apply(ret,this.getRewardIndexesOfType('c2'));
            ret.push.apply(ret,this.getRewardIndexesOfType('c3'));
            ret.push.apply(ret,this.getRewardIndexesOfType('c5'));
            break;
        case 'ff':
            ret.push.apply(ret,this.getRewardIndexesOfType('ff1h'));
            ret.push.apply(ret,this.getRewardIndexesOfType('ff6h'));
            ret.push.apply(ret,this.getRewardIndexesOfType('ff24'));
            break;
    }
    return ret;
};

Luts.Object.RouletteWindow.prototype.getRewardIndexesOfType = function(type){
    var ret = [];
    this.data.rewards.forEach(function (d,i) {
        if (d == type || type == null){
            ret.push(i);
        }
    });
    return ret;
};

Luts.Object.RouletteWindow.prototype.setData = function(){
    this.data = Luts.Object.RouletteRules.rouletteData(this.rouletteLevel.v.toNumber());
    this.createRoulette(this.data.size);
};

Luts.Object.RouletteWindow.prototype.createRoulette = function (spaces) {
    this.roulette.clear();

    for(var i = 0; i < spaces; i++) {
        this.roulette.beginFill(i % 2 == 0 ? Phaser.Color.hexToRGB(Luts.Config['colors']['red']) : Phaser.Color.hexToRGB(Luts.Config['colors']['gray']));
        this.roulette.lineWidth = 1;
        this.roulette.lineColor = 0xffffff;
        this.roulette.drawTriangle([
            {x: 0, y: 0},
            {x: Math.sin(Math.PI * 2* i / spaces) * this.rouletteSize, y: Math.cos(Math.PI * 2 * i / spaces) * this.rouletteSize},
            {x: Math.sin(Math.PI * 2* (i + 1) / spaces) * this.rouletteSize, y: Math.cos(Math.PI * 2 * (i + 1) / spaces) * this.rouletteSize}]);
        this.roulette.endFill();

        var icon,text;
        if (i >= this.rouletteIcons.length){
            icon = this.game.add.image(0,0,'ingame','roulette_d1');
            icon.anchor.set(0.5);
            text = new Luts.Object.Text(this.state,0,0,'text','',16,'#ffffff');
            text.anchor.set(0.5);
            icon.toti = new Luts.Object.Tooltip(this.state,icon,Luts.Object.RouletteRules.data(this.data.rewards[i]).name);

            this.rouletteIcons.push(icon);
            this.rouletteTexts.push(text);

            this.roulette.addChild(icon);
            this.roulette.addChild(text);
        } else {
            icon = this.rouletteIcons[i];
            text = this.rouletteTexts[i];
        }
        icon.x = Math.sin(Math.PI * 2* (i + 0.5) / spaces) * this.rouletteSize * 0.4;
        icon.y = Math.cos(Math.PI * 2* (i + 0.5) / spaces) * this.rouletteSize * 0.4;
        icon.rotation = Phaser.Math.angleBetween(0,0,icon.x,icon.y) + Math.PI / 2;

        text.x = Math.sin(Math.PI * 2* (i + 0.5) / spaces) * this.rouletteSize * 0.3;
        text.y = Math.cos(Math.PI * 2* (i + 0.5) / spaces) * this.rouletteSize * 0.3;
        text.rotation = icon.rotation;


        icon.frameName = Luts.Object.RouletteRules.data(this.data.rewards[i]).icon;
        text.setText(Luts.Object.RouletteRules.data(this.data.rewards[i]).text);
        icon.toti.setText(Luts.Object.RouletteRules.data(this.data.rewards[i]).name);
        icon.visible = true;
        text.visible = true;

        if (spaces >= 24){
            icon.scale.set(0.75);
            text.scale.set(0.75);
        }else{
            icon.scale.set(1);
            text.scale.set(1);
        }
    }

    for(var j = i; j < this.rouletteIcons.length; j++){
        this.rouletteIcons[j].visible = false;
        this.rouletteTexts[j].visible = false;
    }
};
