    if (id == 'daily'){
        btn.setActive(false);
        btn.setActive(true, Luts.Time.lastDailyReward - (new Date() .getTime() - 1000 * 60 * 60 *24));
    }

    this.tabs.setTabButton(id,btn);
    return tab;
