Luts.Object.MtxWindow.prototype.addItem = function(item,desc,bp){
    var xPos = (this.scrollIndex % 2) * 300 ;
    var yPos = 30 + this.scrollY;
    var lbl = this.game.add.image(xPos,yPos,'ui',desc ? 'label' : 'labelSmall');
    this.scroll.addToScrollGroup(lbl);


    var titleText = new Luts.Object.Text(this.state,20, 15,'text',item.name,24,'#ffffff');
    titleText.wordWrapWidth = lbl.width - 40;
    var btn = new Luts.Object.Button(this.state,250,desc ? 190 : 90,'Buy',item.cost + (Luts.Connect.kong ? ' Kreds' : ''),function () {
        Luts.Shop.buyItem(item.id,function (success) {
            if (success){
                if(item.callback)
                    item.callback();
            }
        });
    });
    //titleText.strokeThickness = 0;

    if(bp){
        var bpIcon = this.game.add.image(100,70,'ingame','bpIcon');
        lbl.addChild(bpIcon);
    }
    else if(desc){
        var bpIcon = this.game.add.image(70,48,'ingame','bpIcon');
        lbl.addChild(bpIcon);
    }

    if(desc){
        var descText = new Luts.Object.Text(this.state,20, 55,'text',desc,18,'#000000');
        descText.strokeThickness = 0;
        descText.wordWrapWidth = lbl.width - 40;
        lbl.addChild(descText);
    }

    if(item.canPurchase != null) {
        btn.setActive(item.canPurchase);
        if(!item.canPurchase && item.callback)
            item.callback();
    }

    if(item.onUpdated) {
        item.onUpdated.add(function (itm) {
            if (itm.name)
                titleText.setText(itm.name);
            if (itm.cost)
                btn.subtitle.setText(itm.cost);
            if (itm.canPurchase != null)
                btn.setActive(itm.canPurchase);
        });
    }

    if(item.id && item.id.indexOf('cup') !== -1)
        btn.setLock('diceDuel');

    lbl.addChild(titleText);
    lbl.addChild(btn);

    this.scrollIndex++;
    if(this.scrollIndex % 2 === 0)
        this.scrollY += Math.max(lbl.height,this.scrollYNext);
    else
        this.scrollYNext = lbl.height;
};

