Luts.Object.SlotWindow.prototype.constructor = Luts.Object.SlotWindow;
Luts.Object.SlotWindow.prototype = Object.create(Luts.Object.Window.prototype);

Luts.Object.SlotWindow.prototype.setBuyItemText = function(u){
    var txt = Luts.Format.Color(Luts.Upgrades.isAffordable(u) ? 'green' : 'red') + Luts.Format.Decimal(u.price);
    if (!Luts.Upgrades.isBelowMaxLevel(u))
        txt = Luts.Format.Color('white')+'MAX';
    u.buyItem.subtitle.setText(txt);
};

Luts.Object.SlotWindow.prototype.drawDiaCard = function(){
    if (Luts.Upgrades.upgrade(this.diaCardDraw)) {
        Luts.Events.onCurrencyChanged[9].dispatch(Luts.Upgrades.currency[9]);
        var t2 = Luts.CardRules.typeToString(this.game.rnd.between(2, 14));
        var t = 'caro';
        var u = Luts.Upgrades.get(t + t2 + '_dia');
        var text = '';
        if (u.level === 0) {
            Luts.Upgrades.upgrade(u, true);
            text = 'You draw ' + 'diamond' + ' ' + t2 + '!';
        } else {
            Luts.Upgrades.changeCurrency(8, 10000);
            text = 'You draw ' + 'diamond' + ' ' + t2 + '\nDuplicate :(\n+10k Diamonds';
        }

        this.dcrewardText.setText(text);
        if(!Luts.isActive)
            return;
        var tw2 = this.game.add.tween(this.dcrewardText.scale).to({
            x: 1,
            y: 1
        }, 1000, Phaser.Easing.Elastic.Out, true);
        var tw3 = this.game.add.tween(this.dcrewardText.scale).to({
            x: 0,
            y: 0
        }, 500, Phaser.Easing.Back.In, false);
        tw2.chain(tw3);
    }
};

Luts.Object.SlotWindow.prototype.isFilled = function(){
    var item = this.slots[0][0];
    for(var i=0; i< this.slots.length; i++){
        for(var j=0; j< this.slots[i].length; j++) {
            if(item != this.slots[i][j])
                return false;
        }
    }
    return true;
};

Luts.Object.SlotWindow.prototype.assignItem = function(b){
    if(Luts.Upgrades.value('slotItem' + b.i).greaterThan(this.usedItem[b.i])) {
        this.selectedItem = b.i;
        if(Luts.getSetting('slotFill').value){
            this.loImages.forEach(function (r,x) {
                r.forEach(function (item,y) {
                    if (this.selectedItem === 0){
                        this.usedItem[this.slots[x][y]] -= 1;
                    } else{
                        this.usedItem[this.slots[x][y]] -= 1;
                        this.usedItem[this.selectedItem] += 1;
                    }
                    this.slots[x][y] = this.selectedItem;
                }.bind(this))
            }.bind(this));

            this.selectedItem = 0;
            Luts.Events.changedUsedItem.dispatch();
            this.fillImages();
            Luts.Store.setItem('slots',JSON.stringify(this.slots));
            Luts.Store.setItem('usedSlots',JSON.stringify(this.usedItem));
        }else {
            this.loImages.forEach(function (r) {
                r.forEach(function (item) {
                    item.scale.set(1);
                    this.game.add.tween(item.scale).to({
                        x: 0.9,
                        y: 0.9
                    }, 500, Phaser.Easing.Sinusoidal.InOut, true, 0, 2, true);
                }.bind(this))
            }.bind(this))
        }
    }
};

Luts.Object.SlotWindow.prototype.updateSpinButton = function(){
    if (!this.anySpinning()) {
        this.spinButton.subtitle.setText(Luts.Format.Decimal(Luts.Upgrades.currency[7]));
        this.spinButton.setActive(Luts.Upgrades.currency[7].greaterThan(0),true);
    } else{
        this.spinButton.setActive(true,true);
    }
};

Luts.Object.SlotWindow.prototype.update = function () {
    if (this.shown || true) {
        this.slotImages.forEach(function (x,i) {
            if (this.slotRows[i].spinning) {
                var spd = this.game.rnd.realInRange(5,10) * (i * 0.5 +1);
                x.forEach(function (si) {
                    si.y += spd;
                    if (si.y >= 460)
                        si.y -= 460;
                }.bind(this));
            }
        }.bind(this));
    }
};

Luts.Object.SlotWindow.prototype.prestigeRoulette = function(){
    new Luts.Object.Popup(this.state,'Reset your Chips, Roulette Upgrades and Roulette back to level 1 and get ' + Luts.Format.Decimal(this.state.casinos.v.dividedBy(10).ceil()) + ' Slot spins (Equal to your number of casinos / 10). Are you sure to prestige your roulette?',true,function (yes) {
        if (yes) {
            this.actualPrestigeRoulette();
        }
    }.bind(this));
};

Luts.Object.SlotWindow.prototype.actualPrestigeRoulette = function(){
    if (Luts.Value.get('rouletteLevel').v.greaterThanOrEqualTo(34)) {
        Luts.Value.get('rouletteLevel').set(0);
        Luts.Upgrades.resetOfCurrency(4);
        Luts.Upgrades.changeCurrency(7, (this.state.casinos.v.dividedBy(10).times(this.state.slotSpinMulti.modValue())).ceil());
    }
};

Luts.Object.SlotWindow.prototype.checkLastExport = function(){
    return (Date.now() - Luts.Store.getItem('lastExport',0) < 1000 * 60 * 60);
};
Luts.Object.SlotWindow.prototype.nextSpin = function(){
    return  Luts.Format.Color('red') + Luts.Format.Time(1000 * 60 * 60 - (Date.now() - Luts.Store.getItem('lastExport',0)),true) + '</c>';
};

Luts.Object.SlotWindow.prototype.bpSpin = function(){
    if (!Luts.Lock.get('slotFill').unlocked && this.checkLastExport() && !this.isFilled()){
        new Luts.Object.Popup(this.state,'You exported your save recently. To prevent cheating you have to wait '+ this.nextSpin() +', or fill your layout with the one item to be able to spin again');
        return;
    }

    if (this.anySpinning()){
        this.clickSpin(true);
        return;
    }


    if (Luts.Upgrades.currency[6].greaterThanOrEqualTo(60)){
        new Luts.Object.Popup(this.state,'Do you really want to spend BP to spin?',true,function(yes){
            if (yes) {
                this.clickSpin(true);
                Luts.Upgrades.changeCurrency(6, -60);
            }
        }.bind(this));
    } else {
        if (Luts.Ad.enabled){
            new Luts.Object.Popup(this.state,'You dont have enough Bonus Points. Do you want to watch an Ad to get 5 BPs?',true,function (yes) {
                if (yes) {
                    this.state.shopWindow.requestAdForBp();
                }
            }.bind(this));
        } else if (Luts.mtxEnabled && Luts.Connect.kong){
            new Luts.Object.Popup(this.state,'You dont have enough Bonus Points. Do you want to get more?',true,function (yes) {
                if (yes) {
                    this.state.mtxClicked();
                }
            }.bind(this));
        } else {
            new Luts.Object.Popup(this.state,'You dont have enough Bonus Points. Check in daily and unlock achievements to get more BP');
        }
    }
};

Luts.Object.SlotWindow.prototype.anySpinning = function(){
    for(var i = 0; i < this.columns.value.toNumber(); i++){
        if (this.slotRows[i].spinning)
            return true;
    }
    return false;
};

Luts.Object.SlotWindow.prototype.clickSpin = function (noUpgrade) {
    if (!Luts.Lock.get('slotFill').unlocked && this.checkLastExport() && !this.isFilled()){
        new Luts.Object.Popup(this.state,'You exported your save recently. To prevent cheating you have to wait '+ this.nextSpin() +', or fill your layout with the one item to be able to spin again');
        return;
    }

    if (!this.anySpinning()) {
        if (Luts.Upgrades.upgrade(this.spins, noUpgrade)) {
            this.slotRows.forEach(function (sr,i) {
                if (this.columns.value.greaterThan(i)) {
                    sr.spinning = true;
                    Luts.Store.setItem('spinning' + i, true);
                }
            }.bind(this));
            this.updateSpinButton();

            this.spinButton.text.setText('Stop');
            this.spinButton.subtitle.setText('');
            this.stopPos = 0;
            Luts.Store.setItem('stopPos',this.stopPos);
            this.result = [];
            Luts.Store.setItem('slotResult',JSON.stringify(this.result));
        }
    } else {
        this.slotImages[this.stopPos].forEach(function (si) {
            si.y = Math.round(si.y / 46) * 46 + 12;
            if (si.y === 4 * 46 + 12){
                this.result[this.stopPos] = this.slots[this.stopPos][si.i];
                Luts.Store.setItem('slotResult',JSON.stringify(this.result));
            }
        }.bind(this));

        this.slotRows[this.stopPos].spinning = false;
        Luts.Store.setItem('spinning' + this.stopPos, false);
        this.stopPos++;
        Luts.Store.setItem('stopPos', this.stopPos);
        if (this.stopPos === this.columns.value.toNumber() ||  !this.anySpinning()){
            this.finishSpin();
            this.spinButton.text.setText('Spin');
            Luts.Events.onCurrencyChanged[7].dispatch(Luts.Upgrades.currency[7]);
        }
    }
};

Luts.Object.SlotWindow.prototype.finishSpin = function(){
    var rewards = [];
    var text = '';
    this.result.forEach(function (r,i) {
        if (this.columns.value.greaterThan(i)) {
            if (!rewards[r]) {
                rewards[r] = 1;
            } else {
                rewards[r]++;
            }
        }
    }.bind(this));
    rewards.forEach(function (r,i) {
        if (r > 0) {
            var multi = Math.pow(r,2);
            var reward = this.getReward(i);
            var val = reward.value * multi;
            if (text!=='')
                text+='\n';
            reward.text = reward.text.replace('%',val);
            reward.text = reward.text.replace('$',val === 1 ? '' : 's');
            reward.text = reward.text.replace('',val === 1 ? '' : 'S');
            text+= reward.text;
            reward.cb(multi);
        }
    }.bind(this));

    this.rewardText.setText(text);
    if(!Luts.isActive)
        return;
    var tw2 = this.game.add.tween(this.rewardText.scale).to({
        x: 1,
        y: 1
    }, 1000, Phaser.Easing.Elastic.Out, true);
    var tw3 = this.game.add.tween(this.rewardText.scale).to({
        x: 0,
        y: 0
    }, 500, Phaser.Easing.Back.In, false);
    tw2.chain(tw3);
};


Luts.Object.SlotWindow.prototype.addTab = function (id, text) {
    var tab = this.tabs.add(id);
    this.addChild(tab);
    var btn = new Luts.Object.Button(this.state,85 + (this.tabs.tabs.length - 1) * 120,100,text,'');
    this.addChild(btn);

    this.tabs.setTabButton(id,btn);

    if (id === 'diamondCards')
        btn.setLock('diamondCards');

    return tab;
};

Luts.Object.SlotWindow.prototype.fillImages = function () {
    this.slots.forEach(function (row,x) {
        if (!this.slotImages[x]) {
            this.slotImages[x] = [];
            this.loImages[x] = [];
        }
        row.forEach(function (slot,y) {
            if (!this.slotImages[x][y]){
                this.slotImages[x][y] = this.game.add.image(0,46 * y + 12,'ingame','slotBack' + (y % 2));
                this.slotImages[x][y].i = y;
                this.slotImages[x][y].icon = this.game.add.image(23,23,'ingame','slotItem0');
                this.slotImages[x][y].icon.anchor.set(0.5);
                this.slotImages[x][y].addChild(this.slotImages[x][y].icon);
                this.slotRows[x].addChild(this.slotImages[x][y]);

                this.loImages[x][y] = this.game.add.image(46 * y + 12 + 23,23,'ingame','slotBack' + (y % 2));
                this.loImages[x][y].i = y;
                this.loImages[x][y].anchor.set(0.5);
                this.loImages[x][y].sx = x;
                this.loImages[x][y].sy = y;
                this.loImages[x][y].icon = this.game.add.image(0,0,'ingame','slotItem0');
                this.loImages[x][y].icon.anchor.set(0.5);
                this.loImages[x][y].addChild(this.loImages[x][y].icon);
                this.layoutRows[x].addChild(this.loImages[x][y]);

                this.loImages[x][y].inputEnabled = true;
                this.loImages[x][y].events.onInputDown.add(function (img) {
                    if (this.selectedItem === 0){
                        this.usedItem[this.slots[img.sx][img.sy]] -= 1;
                    } else{
                        this.usedItem[this.slots[img.sx][img.sy]] -= 1;
                        this.usedItem[this.selectedItem] += 1;
                    }

                    this.slots[img.sx][img.sy] = this.selectedItem;
                    if (this.selectedItem === 0 || Luts.Upgrades.value('slotItem'+this.selectedItem).lessThanOrEqualTo(this.usedItem[this.selectedItem]))
                        this.selectedItem = 0;
                    Luts.Events.changedUsedItem.dispatch();
                    this.fillImages();
                    Luts.Store.setItem('slots',JSON.stringify(this.slots));
                    Luts.Store.setItem('usedSlots',JSON.stringify(this.usedItem));
                },this);
            }
            this.slotImages[x][y].icon.frameName = 'slotItem' + slot;
            this.loImages[x][y].icon.frameName = 'slotItem' + slot;
        }.bind(this));
    }.bind(this));
};

Luts.Object.SlotWindow.prototype.getReward = function (i) {
    var cb = function () {};
    var value = 0;
    var text = '';
    switch (i) {
        case 0:
            cb = function (v) {
                Luts.Upgrades.changeCurrency(8,1*v);
            };
            value = 1;
            text = '+% Diamond$!';
            break;
        case 1:
            cb = function (v) {
                Luts.Upgrades.changeCurrency(8,5*v);
            };
            value = 5;
            text = '+% Diamonds!';
            break;
        case 2:
            cb = function (v) {
                Luts.Value.get('comboMulti').changeMultiplier('slot',1,2*v,1);
            };
            value = 2;
            text = 'Combomultiplier +x%!';
            break;
        case 3:
            cb = function (v) {
                Luts.Upgrades.changeCurrency(8,25*v);
            };
            value = 25;
            text = '+% Diamonds!';
            break;
        case 4:
            cb = function (v) {
                Luts.Value.get('chipMulti').changeMultiplier('slot',1,2*v,1);
            };
            value = 2;
            text = 'Chipmulti +x%!';
            break;
        case 5:
            cb = function (v) {
                Luts.Upgrades.changeCurrency(8,125*v);
            };
            value = 125;
            text = '+% Diamonds!';
            break;
        case 6:
            cb = function (v) {
                Luts.Upgrades.changeCurrency(9,v);
                Luts.Lock.unlock('diamondCards');
            };
            value = 1;
            text = '+% DIAMOND CARD POINT!!';
            break;
        case 7:
            cb = function (v) {
                Luts.Upgrades.changeCurrency(11,Luts.Value.get('cupPointMulti').modValue().times(v));
            };
            value = Luts.Value.get('cupPointMulti').modValue();
            text = '+% CUP POINT!!!!!!1';
            break;
    }
    return{
        cb: cb, value: value, text: text
    }
};
