        this.cupDice1.visible = true;
        this.cupDice2.visible = true;
        this.cupDice3.visible = true;

        this.cupDice1.icon.visible = false;
        this.cupDice2.icon.visible = false;
        this.cupDice3.icon.visible = false;

        this.cupText1.visible = false;
        this.cupText2.visible = false;
        this.cupText3.visible = false;

        this.cupShine1.visible = false;
        this.cupShine2.visible = false;
        this.cupShine3.visible = false;

        var cupIndex = Luts.Object.DuelHandler.openCup();
        var opened = [Luts.Object.DuelHandler.dice[cupIndex[0]],Luts.Object.DuelHandler.dice[cupIndex[1]],Luts.Object.DuelHandler.dice[cupIndex[2]]];
        this.cupDice1.icon.tooltip.setText(Luts.Object.DuelHandler.getDesc(opened[0],1));
        this.cupDice2.icon.tooltip.setText(Luts.Object.DuelHandler.getDesc(opened[1],1));
        this.cupDice3.icon.tooltip.setText(Luts.Object.DuelHandler.getDesc(opened[2],1));

        this.cupText1.setText(opened[0].name + '\nPower: ' + opened[0].power + '\nRarity: ' + opened[0].rarity);
        this.cupText2.setText(opened[1].name + '\nPower: ' + opened[1].power + '\nRarity: ' + opened[1].rarity);
        this.cupText3.setText(opened[2].name + '\nPower: ' + opened[2].power + '\nRarity: ' + opened[2].rarity);

        this.cupDice1.frameName = opened[0].d === 6 ? 'd6_6' : 'd' + opened[0].d;
        this.cupDice2.frameName = opened[1].d === 6 ? 'd6_6' : 'd' + opened[1].d;
        this.cupDice3.frameName = opened[2].d === 6 ? 'd6_6' : 'd' + opened[2].d;

        if (opened[0].icon) {
            this.cupDice1.icon.visible = true;
            this.cupDice1.icon.frameName = 'dd_' + opened[0].icon;
        }
        if (opened[1].icon) {
            this.cupDice2.icon.visible = true;
            this.cupDice2.icon.frameName = 'dd_' + opened[1].icon;
        }
        if (opened[2].icon) {
            this.cupDice3.icon.visible = true;
            this.cupDice3.icon.frameName = 'dd_' + opened[2].icon;
        }
        this.cupDice1.y = 200;
        this.cupDice1.angle = 0;
        var dly = this.game.rnd.between(0, 250);
        var anim = this.game.rnd.between(500, 1000);
        var rollAnim1 = this.game.add.tween(this.cupDice1).from({y: -500}, anim, Phaser.Easing.Bounce.Out, true, dly);
        this.game.add.tween(this.cupDice1).from({angle: this.game.rnd.between(-360, 360)}, anim, Phaser.Easing.Back.Out, true, dly);
        var cupAnim = ++this.cupAnimCounter;

        rollAnim1.onComplete.add(function () {
            if(cupAnim !== this.cupAnimCounter)
                return;
            this.cupText1.visible = true;

            if (opened[0].rarity !== 'common') {
                this.cupShine1.visible = true;
                this.cupShine1.frameName = 'rarity_' + opened[0].rarity;
            }
        }.bind(this));

        this.cupDice2.y = 200;
        this.cupDice2.angle = 0;
        dly = this.game.rnd.between(0, 250);
        var anim = this.game.rnd.between(500, 1000);
        var rollAnim2 = this.game.add.tween(this.cupDice2).from({y: -500}, anim, Phaser.Easing.Bounce.Out, true, dly);
        this.game.add.tween(this.cupDice2).from({angle: this.game.rnd.between(-360, 360)}, anim, Phaser.Easing.Back.Out, true, dly);

        rollAnim2.onComplete.add(function () {
            if(cupAnim !== this.cupAnimCounter)
                return;
            this.cupText2.visible = true;

            if (opened[1].rarity !== 'common') {
                this.cupShine2.visible = true;
                this.cupShine2.frameName = 'rarity_' + opened[1].rarity;
            }
        }.bind(this));

        this.cupDice3.y = 200;
        this.cupDice3.angle = 0;
        dly = this.game.rnd.between(0, 250);
        var anim = this.game.rnd.between(500, 1000);
        var rollAnim3 = this.game.add.tween(this.cupDice3).from({y: -500}, anim, Phaser.Easing.Bounce.Out, true, dly);
        this.game.add.tween(this.cupDice3).from({angle: this.game.rnd.between(-360, 360)}, anim, Phaser.Easing.Back.Out, true, dly);

        rollAnim3.onComplete.add(function () {
            if(cupAnim !== this.cupAnimCounter)
                return;
            this.cupText3.visible = true;
            if (opened[2].rarity !== 'common') {
                this.cupShine3.visible = true;
                this.cupShine3.frameName = 'rarity_' + opened[2].rarity;
            }

        }.bind(this));

        this.state.duelInventory.push({d: cupIndex[0],l:0});
        this.state.duelInventory.push({d: cupIndex[1],l:0});
        this.state.duelInventory.push({d: cupIndex[2],l:0});

        Luts.Store.setItem('col' + opened[0].name+opened[0].d,true);
        Luts.Store.setItem('col' + opened[1].name+opened[1].d,true);
        Luts.Store.setItem('col' + opened[2].name+opened[2].d,true);

