Luts.Object.DiceWindow.prototype.updateInventory = function(){
    this.inventory.forEach(function (d,i) {
        if(i > this.state.duelInventory.length - 1) {
            d.tooltip.destroy();
            d.destroy();
        }
    }.bind(this));

    this.inventory = this.inventory.slice(0,this.state.duelInventory.length);

    this.state.duelInventory.sort(function (a,b) {
        var dA =Luts.Object.DuelHandler.dice[a.d];
        var dB =Luts.Object.DuelHandler.dice[b.d];
        var pA = Luts.Object.DuelHandler.realPower(dA,a.l);
        var pB = Luts.Object.DuelHandler.realPower(dB,b.l);
        var ret = (pB-pA) * 0.000001;
        switch (this.sortBy) {
            case 'Nothing':
            default:
                return 0;
            case 'Power':
                return pB - pA;
            case 'Level':
                return (b.l - a.l) + ret;
            case 'Rarity':
                return (Luts.Object.DuelHandler.rarityToNumber(dB.rarity) - Luts.Object.DuelHandler.rarityToNumber(dA.rarity)) + ret;
            case 'Dice Type':
                return (Luts.Object.DuelHandler.levelToDiceType(dB.d,b.l) - Luts.Object.DuelHandler.levelToDiceType(dA.d,a.l)) + ret;
            case 'Name':
                if(dA.name < dB.name) { return -1; }
                if(dA.name > dB.name) { return 1; }
                return 0;
        }
        return ret;
    }.bind(this));

    this.state.duelInventory.forEach(function (d,i) {
        if(!this.inventory[i]){
            this.inventory[i] = new Luts.Object.Button(this.state,40 + (i % 8) * 75,40 + Math.floor(i/8) * 75,'','',this.equip.bind(this));
            this.inventoryScroll.addToScrollGroup(this.inventory[i]);
            new Luts.Object.Tooltip(this.state,this.inventory[i],'');

            this.inventory[i].icon = this.game.add.image(0,0,'ingame');
            this.inventory[i].icon.anchor.set(0.5);
            this.inventory[i].addChild(this.inventory[i].icon);
        }

        this.inventory[i].i = i;
        this.inventory[i].dataIndex = d.d;
        this.inventory[i].level = d.l;
        this.inventory[i].loadTexture('ingame');

        var diceType = Luts.Object.DuelHandler.levelToDiceType(Luts.Object.DuelHandler.dice[d.d].d,d.l);
        var frame;
        if (diceType === 6)
            frame = 'd6_6';
        else
            frame = 'd' + diceType;
        this.inventory[i].setFrames(frame,frame);
        var data = Luts.Object.DuelHandler.dice[d.d];
        if(data.icon){
            this.inventory[i].icon.frameName = 'dd_' + data.icon;
            this.inventory[i].icon.visible = true;
        } else {
            this.inventory[i].icon.visible = false;
        }

        this.inventory[i].data = data;
        this.inventory[i].tooltip.setText(Luts.Object.DuelHandler.getDesc(data,d.l));
    }.bind(this));

    Luts.Store.setItem('duelInventory',JSON.stringify(this.state.duelInventory));
};

Luts.Object.DiceWindow.prototype.equip = function(d){
    if(this.state.nextDuelSet.length >= 5)
        return;

    this.state.duelInventory.splice(d.i,1);
    this.state.nextDuelSet.push({d:d.dataIndex,l:d.level});

    this.updateInventory();
    this.updateSet();
};

Luts.Object.DiceWindow.prototype.unequip = function(d){
    this.state.duelInventory.push(d.d);
    this.state.nextDuelSet.splice(d.i,1);
    this.updateSet();
    this.updateInventory();
};

Luts.Object.DiceWindow.prototype.updateSet = function(){
    this.currentSet.diceImages.forEach(function (d) {
        d.visible = false;
        d.icon.visible = false;
    });

    var diceData = [];
    this.state.nextDuelSet.forEach(function (d,i) {
        var data = Luts.Object.DuelHandler.dice[d.d];
        var diceType = Luts.Object.DuelHandler.levelToDiceType(data.d,d.l);
        var frame;
        if (diceType === 6)
            frame = 'd6_6';
        else
            frame = 'd' + diceType;

        this.currentSet.diceImages[i].setFrames(frame,frame);
        this.currentSet.diceImages[i].visible = true;
        this.currentSet.diceImages[i].d = d;
        if(data.icon){
            this.currentSet.diceImages[i].icon.visible = true;
            this.currentSet.diceImages[i].icon.frameName = 'dd_' + data.icon;
        }

        diceData.push({data: data, level: d.l});
        this.currentSet.diceImages[i].tooltip.setText(Luts.Object.DuelHandler.getDesc(data,d.l));
    }.bind(this));


    Luts.Store.setItem('duelSet',JSON.stringify(this.state.nextDuelSet));
};

Luts.Object.DiceWindow.prototype.updateCollection = function(){
    this.collection.forEach(function (d) {
        d.destroy();
    });
    this.collection = [];
    var total = 0;
    var found = 0;
    var i = 0;

    ['common','rare','epic','legendary'].forEach(function (rarity) {
        Luts.Object.DuelHandler.dice.forEach(function (dice) {
            if(dice.rarity !== rarity)
                return;
            var d = dice.d;
            var level = 0;
            do{
                total ++;
                d = Luts.Object.DuelHandler.levelToDiceType(dice.d,level);
                var frame = (d===6) ? 'd6_6' : ('d' + d);
                var colItem = this.game.add.image(40 + [2,4,6,8,10,12,20,100].indexOf(d) * 75,40 + i * 75,'ingame',frame);
                this.collection.push(colItem);
                this.collectionScroll.addToScrollGroup(colItem);
                colItem.anchor.set(0.5);
                if (!Luts.Store.getItem('col'+dice.name+d,false)) {
                    colItem.alpha = 0.3;
                }else{
                    found++;
                    new Luts.Object.Tooltip(this.state,colItem,Luts.Object.DuelHandler.getDesc(dice,level));
                }
                if(dice.icon){
                    colItem.icon = this.game.add.image(0,0,'ingame','dd_'+dice.icon);
                    colItem.icon.anchor.set(0.5);
                    colItem.addChild(colItem.icon);
                }
            }while(level++ < Luts.Object.DuelHandler.maxLevelDiceType(dice.d));
            i++;
        }.bind(this));
    }.bind(this));

    Luts.Events.onCollectionChanged.dispatch(found);
    this.collectionTab.foundText.setText('Found ' + found + '/' + total);
};

Luts.Object.DiceWindow.prototype.update = function () {
    if (this.shown) {
        this.inventoryScroll.update();
        this.collectionScroll.update();
    }

    if(this.openMax)
        this.openCup();
};

Luts.Object.DiceWindow.prototype.bpSpin = function(){
    if (Luts.Upgrades.currency[6].greaterThanOrEqualTo(60)){
        new Luts.Object.Popup(this.state,'Do you really want to spend BP to spin?',true,function(yes){
            if (yes) {
                this.clickSpin(true);
                Luts.Upgrades.changeCurrency(6, -60);
            }
        }.bind(this));
    } else {
        if (Luts.Ad.enabled){
            new Luts.Object.Popup(this.state,'You dont have enough Bonus Points. Do you want to watch an Ad to get 5 BPs?',true,function (yes) {
                if (yes) {
                    this.state.shopWindow.requestAdForBp();
                }
            }.bind(this));
        } else if (Luts.mtxEnabled && Luts.Connect.kong){
            new Luts.Object.Popup(this.state,'You dont have enough Bonus Points. Do you want to get more?',true,function (yes) {
                if (yes) {
                    this.state.mtxClicked();
                }
            }.bind(this));
        } else {
            new Luts.Object.Popup(this.state,'You dont have enough Bonus Points. Check in daily and unlock achievements to get more BP');
        }
    }
};

