Luts.Object.PvpWindow = function(state){
    Luts.Object.Window.call(this, state,'PvP',function () {
        this.tabs = new Luts.Object.TabManager(state,0,0);
        this.highscoreTab = this.addTab('highscore','Highscore');

        this.tabs.show('highscore');

        this.scroll = new Luts.Object.Scrollable(this.state,10,120,this.rWidth - 30,this.rHeight - 150);
        this.addChild(this.scroll);
        this.scrollIndex = 0;


        var rank = new Luts.Object.Text(this.state,10,0,'text','Rank',20);
        this.scroll.addToScrollGroup(rank);
        var name = new Luts.Object.Text(this.state,100,0,'text','Name',20);
        this.scroll.addToScrollGroup(name);
        var power = new Luts.Object.Text(this.state,350,0,'text','Power',20);
        this.scroll.addToScrollGroup(power);
        var elo = new Luts.Object.Text(this.state,550,0,'text','Elo',20);
        this.scroll.addToScrollGroup(elo);

        this.highscoreTab.onShow.add(this.loadHighscoreEntries,this);

        this.loadedHighscore = false;
        this.highscoreEntries = [];
    }.bind(this));
};

Luts.Object.PvpWindow.prototype.constructor = Luts.Object.PvpWindow;
Luts.Object.PvpWindow.prototype = Object.create(Luts.Object.Window.prototype);

Luts.Object.PvpWindow.prototype.loadHighscoreEntries = function(){
    Luts.Util.httpGetAsync(Luts.duelServer + 'highscore',function (docs) {
        docs = JSON.parse(docs);
        if(docs.success) {
            this.highscoreEntries.forEach(function (e) {
                e.destroy();
            });
            this.highscoreEntries = [];
            this.scrollIndex = 0;
            this.playerInHighscore = false;
            docs.data.forEach(this.addHighscoreEntry.bind(this));
            if(!this.playerInHighscore){
                Luts.Util.httpGetAsync(Luts.duelServer + 'highscore/' + Luts.Connect.playerId,function (docs) {
                    docs = JSON.parse(docs);
                    if (docs.success && docs.data){
                        this.addHighscoreEntry(docs.data,true);
                    }
                }.bind(this));
            }
        }
    }.bind(this));
};

Luts.Object.PvpWindow.prototype.addTab = function (id, text) {
    var tab = this.tabs.add(id);
    this.addChild(tab);
    var btn = new Luts.Object.Button(this.state,75 + (this.tabs.tabs.length - 1) * 99,100,text,'');
    this.addChild(btn);

    this.tabs.setTabButton(id,btn);
    return tab;
};

Luts.Object.PvpWindow.prototype.update = function () {
    if (!this.shown) {
        this.loadedHighscore = false;
        return;
    }
    if(!this.loadedHighscore){
        this.loadedHighscore = true;
        this.loadHighscoreEntries();
    }

    this.scroll.update();
};

Luts.Object.PvpWindow.prototype.addHighscoreEntry = function (data,last) {
    this.scrollIndex++;
    var entry = this.state.game.add.image(0,this.scrollIndex*30);
    this.scroll.addToScrollGroup(entry);
    this.highscoreEntries.push(entry);
    var isPlayer = data.playerId === Luts.Connect.userId.toString();
    this.playerInHighscore = this.playerInHighscore || isPlayer;
    var color = this.scrollIndex > 3 ? '#000000' : '#ffffff';
    var fontSize = 20 + 2 * Math.max(0,3-this.scrollIndex);
    var rank = new Luts.Object.Text(this.state,10,0,'text',last !== true ? this.scrollIndex : '>' + (this.scrollIndex - 1),fontSize,isPlayer ? Luts.Config.colors.green : color);
    if (this.scrollIndex > 3)
        rank.strokeThickness = 0;
    entry.addChild(rank);
    var name = new Luts.Object.Text(this.state,100,0,'text',data.userName,20,isPlayer ? Luts.Config.colors.green : '#000000');
    name.strokeThickness = 0;
    entry.addChild(name);
    var elo = new Luts.Object.Text(this.state,550,0,'text',data.elo || 800,20,isPlayer ? Luts.Config.colors.green : '#000000');
    elo.strokeThickness = 0;
    entry.addChild(elo);

    var p = 0;
    for(var i = 0; i < data.set.length; i++){
        p += Luts.Object.DuelHandler.realPower(Luts.Object.DuelHandler.dice[data.set[i].d], data.set[i].l);
    }

    var power = new Luts.Object.Text(this.state,350,0,'text',Luts.Format.Decimal(p),20,isPlayer ? Luts.Config.colors.green : '#000000');
    power.strokeThickness = 0;
    entry.addChild(power);
};
