Luts.Object.Card.prototype.constructor = Luts.Object.Card;
Luts.Object.Card.prototype = Object.create(Luts.Object.Button.prototype);

Luts.Object.Card.prototype.onPrestige = function () {
    this.setType(this.ctype,this.ctype2);
};

Luts.Object.Card.prototype.onUpgrade = function (u) {
    var uIsCard = false;
    this.types2.forEach(function (t) {
        uIsCard = (u.name.indexOf(t) !== -1) || uIsCard;
    });
    if(uIsCard)
        this.setType(this.ctype,this.ctype2);
};

Luts.Object.Card.prototype.clickCard = function(){
    if (this.golden){
        if (Luts.Value.get('confirmEnabled').v.equals(0)){
            Luts.Upgrades.upgrade(this.upgrade);
            this.state.luckMulti.changeMultiplier('luckPerGold',1,Luts.Upgrades.value('luckPerGold'),null,'prestige3');
            Luts.Events.onDrawCard.dispatch();
        }else {
            new Luts.Object.Popup(this.state, 'Are you sure to gild this card?', true, function (yes) {
                if (yes) {
                    Luts.Upgrades.upgrade(this.upgrade);
                    Luts.Events.onDrawCard.dispatch();
                }
            }.bind(this))
        }
    }else if (!this.diamond){
        if (Luts.Upgrades.currency[2].greaterThan(0)) {
            if (!this.state.gildPopup) {
                this.state.gildPopup = true;
                new Luts.Object.Popup(this.state, 'Gild a card first! (Deck tab)', false, function () {
                    this.state.gildPopup = false;
                }.bind(this));
            }
        }else {
            Luts.Upgrades.upgrade(this.upgrade);
            Luts.Events.onDrawCard.dispatch();
        }
    }
};

Luts.Object.Card.prototype.setType = function(type,type2,dontAllowUpgrade){
    if (type == null)
        type = this.ctype;
    if (type2 == null)
        type2 = this.ctype2;

    this.ctype = type;
    this.ctype2 = type2;
    if (this.diamond)
        this.upgrade = Luts.Upgrades.get(type2 + type + '_dia');
    else
        this.upgrade = Luts.Upgrades.get(type2 + type + (this.golden ? '_gold' : ''));
    this.goldUpgrade = Luts.Upgrades.get(type2 + type + '_gold');
    this.diaUpgrade = Luts.Upgrades.get(type2 + type + '_dia');
    this.data = Luts.CardRules.data(type);
    this.colorName = (type2 == 'heart' || type2 == 'caro') ? 'red' : 'gray';
    this.color = Luts.Config['colors'][this.colorName];
    this.typeText.frameName = this.colorName+type;
    this.typeTextSmall.frameName = this.colorName + type;
    this.typeTextSmallMirror.frameName = this.colorName +type;
    this.type2Image.frameName = type2;
    this.type2ImageMirror.frameName = type2;

    this.tooltip.setText(this.data.desc);

    this.dia.visible = (this.diaUpgrade.level >= 1);
    if(this.dia.visible && this.goldUpgrade.level == 0 && !dontAllowUpgrade)
        Luts.Upgrades.upgrade(this.goldUpgrade,true);
    this.gold.visible = (this.goldUpgrade.level >= 1) && !this.diamond;
    if(this.gold.visible && this.upgrade.level == 0 && !dontAllowUpgrade)
        Luts.Upgrades.upgrade(this.upgrade,true);
    if (this.drawable && this.desc){
        this.desc.setText(this.data.desc + '\n(' + Luts.Object.AchievementsHandler.unlockedCardTypeNum(type) + ')',20);
    }
    if (!this.drawable){
        this.callback = function () {};
        this.alpha = this.upgrade.level >= 1 ? 1 : 0.2;
        this.setActive(this.upgrade.level >= 1,true);
    }
};

Luts.Object.Card.prototype.randomType = function(id,first,second){
    var counter = 0;
    do {
        var type = this.game.rnd.between(2, 14);
        var type2 = this.game.rnd.pick(this.types2);
        var condition = false;
        if (id == 1 && Luts.CardRules.typeToString(type) == first)
            condition = true;
        if (id == 2 && (Luts.CardRules.typeToString(type) == first || Luts.CardRules.typeToString(type) == second))
            condition = true;
        if (Luts.Upgrades.get(type2 + Luts.CardRules.typeToString(type)).level >= 1)
            condition = true;
    }while(condition && counter++ < 1000);

    Luts.Store.setItem('c' + id + 't1',Luts.CardRules.typeToString(type));
    Luts.Store.setItem('c' + id + 't2',type2);

    this.setType( Luts.CardRules.typeToString(type),type2);
    this.visible = condition;
    this.desc.visible = condition;
};

