Luts.Object.RouletteRules.diceMulti = function(dice,multi) {
    var value = Luts.Value.get('main'+dice+'_multi');
    var mul = value.getMultiplier('rd'+dice+'x'+multi);

    value.setMultiplier('rd'+dice+'x'+multi, mul ? mul.value.times(multi) : multi, null, 'prestige');
};
Luts.Object.RouletteRules.cardMulti = function(multi) {
    var value = Luts.Value.get('cardProgressMulti');
    var mul = value.getMultiplier('rouletteCard');

    value.setMultiplier('rouletteCard', mul ? mul.value.times(multi) : multi, null, 'prestige');
};

