    var upgradeAble = Luts.Upgrades.isUpgradeable(this.upgrade,false);

    this.subtitle.setText('<c=' + (upgradeAble ? Luts.Config['colors']['green'] : Luts.Config['colors']['red'])  + '>'+ Luts.Format.Decimal(Luts.Upgrades.priceMultiple(this.upgrade),false,0));
