Luts.Object.BonusUpgradeButton.prototype.constructor = Luts.Object.BonusUpgradeButton;
Luts.Object.BonusUpgradeButton.prototype = Object.create(Phaser.Image.prototype);

Luts.Object.BonusUpgradeButton.prototype.clickUpgrade = function(){
    new Luts.Object.Popup(this.state,'Are you sure to purchase ' + this.upgrade.displayName + ' for ' + this.upgrade.price + 'BP?\n'+this.upgrade.description,true,function (y) {
        if (y){
            var success = Luts.Upgrades.upgradeMultiple(this.upgrade,1);
            this.updateText();
            this.state.shopWindow.applyUpgrades();

            if (!success){
                if (Luts.mtxEnabled && (Luts.Connect.kong || Luts.Connect.store2)){
                    new Luts.Object.Popup(this.state,'You dont have enough Bonus Points. Do you want to get more?',true,function (yes) {
                        if (yes) {
                            this.state.mtxClicked();
                        }
                    }.bind(this));
                } else if (Luts.Ad.enabled){
                    new Luts.Object.Popup(this.state,'You dont have enough Bonus Points. Do you want to watch an Ad to get 5 BPs?',true,function (yes) {
                        if (yes) {
                            this.state.shopWindow.requestAdForBp();
                        }
                    }.bind(this));
                } else {
                    new Luts.Object.Popup(this.state,'You dont have enough Bonus Points. Check in daily and unlock achievements to get more BP');
                }
            }
        }
    }.bind(this));
};

Luts.Object.BonusUpgradeButton.prototype.updateText = function(){
    var upgradeAble = Luts.Upgrades.isUpgradeable(this.upgrade,false,1);

    this.button.subtitle.setText('<c=' + (upgradeAble ? Luts.Config['colors']['green'] : Luts.Config['colors']['red'])  + '>'+ Luts.Format.Decimal(Luts.Upgrades.priceMultiple(this.upgrade,1),false,0));
    this.valueText.setText("Value: "+Luts.Format.Decimal(this.upgrade.value));

    if (!Luts.Upgrades.isBelowMaxLevel(this.upgrade))
        this.button.subtitle.setText('MAX');

    //this.setActive(upgradeAble);
};

