    //Phaser.Image.call(this, state.game, x, y, "ingame",'cardBack');
    this.loadTexture('ingame');
    this.setFrames('cardBack','cardBack');
    this.setActive(false);

    this.pos = pos;

    state.game.add.existing(this);
    this.game = state.game;
    this.state = state;
    this.anchor.set(0.5);
    this.data = Luts.CardRules.data(type);
    this.isGold = gold;

    var type2 = 'caro';
    this.colorName = (type2 == 'heart' || type2 == 'caro') ? 'red' : 'gray';
    this.color = Luts.Config['colors'][this.colorName];

    this.typeText = this.game.add.image(0,0,'ingame',this.colorName+type);
    this.typeText.strokeThickness = 0;
    this.typeText.anchor.set(0.5);
    this.addChild(this.typeText);

    this.typeTextSmall = this.game.add.image(-45,-75,'ingame',this.colorName+type);
    this.typeTextSmall.scale.set(0.3);
    this.typeTextSmall.anchor.set(0.5);
    this.addChild(this.typeTextSmall);

    this.type2Image = this.game.add.image(-45,-50,'ingame',type2);
    this.type2Image.anchor.set(0.5);
    this.addChild(this.type2Image);

    this.typeTextSmallMirror = this.game.add.image(45,75,'ingame',this.colorName+type);
    this.typeTextSmallMirror.scale.set(0.3);
    this.typeTextSmallMirror.anchor.set(0.5);
    this.typeTextSmallMirror.angle = 180;
    this.addChild(this.typeTextSmallMirror);

    this.type2ImageMirror = this.game.add.image(45,50,'ingame',type2);
