Luts.Object.DuelHandler.init = function(){
    this.rnd= new Phaser.RandomDataGenerator(Luts.Store.getItem('duelSeed'));
    this.cupRnd = new Phaser.RandomDataGenerator(Luts.Store.getItem('cupRnd'));
};

Luts.Object.DuelHandler.generateEnemy = function (power) {
      power = Math.max(6,power);

      var sum = 0;
      var ret = [];
      var count = 100;

      Luts.Store.setItem('duelSeed',this.rnd.state());
      while(((sum < power && count-- > 0) || ret.length === 0) && ret.length < 5){
          var currentDice = this.rnd.pick(this.dice);
          if(sum + currentDice.power <= power) {
              var level = 0;
              while (sum + this.realPower(currentDice,level+1) < power / (5-ret.length)){
                  level++;
              }
              sum += this.realPower(currentDice,level);
              ret.push({data: currentDice, level: Math.max(0,level)});
          }
      }
      return ret;
};

Luts.Object.DuelHandler.getDesc = function(dice,level){
    return (dice.name + '\nPower: '+Luts.Format.Decimal(this.realPower(dice,level))+'\nLevel: '+level + ' (D'+this.levelToDiceType(dice.d,level)+')' +'\nRarity: ' + dice.rarity + '\n\n' + dice.desc);
};

Luts.Object.DuelHandler.levelToPower = function(level){
    //return Math.max(6 + level * 12,5 + Math.pow(1.2,level));
    return 6 + level * 21;
};

Luts.Object.DuelHandler.openCup = function(){
    return [this.openCupDice(),this.openCupDice(),this.openCupDice()];
};

Luts.Object.DuelHandler.openCupDice = function(){
    var rnd = this.cupRnd.frac();
    var sum = 0;
    var rarity = 'common';
    for(var i = 0; i < this.rarities.length; i++) {
        if (rnd <= sum + this.rarities[i].chance){
            rarity = this.rarities[i].name;
            break;
        }else{
            sum += this.rarities[i].chance;
        }
    }

    var rarityDice = [];
    this.dice.forEach(function (dice,i) {
        if (dice.rarity === rarity)
            rarityDice.push(i);
    });
    var dice = this.cupRnd.pick(rarityDice);
    Luts.Store.setItem('cupRnd',this.cupRnd.state());

    return dice;
};

