Luts.Object.DuelHandler.realPower = function(dice,level){
    var maxLevel = this.maxLevelDiceType(dice.d);
    var diceType = this.levelToDiceType(dice.d,level);
    var linearLevel = (diceType - dice.d) / (100 - dice.d);

    return Phaser.Math.linear(dice.power,dice.powerMax,linearLevel) * this.ascendMulti(dice.d,level);

    //return this.levelToDiceType(dice.d,level) * (dice.power / dice.d) * this.ascendMulti(dice.d,level);

};

Luts.Object.DuelHandler.ascendMulti = function(diceType,level){
    return Math.pow(10,Math.floor(level / (this.maxLevelDiceType(diceType) + 1)));
};


Luts.Object.DuelHandler.Test = {
    rnd: new Phaser.RandomDataGenerator(),
    match: function (set1,set2,noLog) {
        for(var i = 0; i < set1.length; i++){
            set1[i].data = Luts.Object.DuelHandler.dice[set1[i].d];
            set1[i].level = set1[i].l;
        }
        for(var j = 0; j < set2.length; j++){
            set2[j].data = Luts.Object.DuelHandler.dice[set2[j].d];
            set2[j].level = set2[j].l;
        }

        this.playerOwn = new Luts.Object.DuelDicePlayer(this.rnd,'You');
        this.playerOther = new Luts.Object.DuelDicePlayer(this.rnd,'Enemy');

        this.playerOwn.other = this.playerOther;
        this.playerOther.other = this.playerOwn;

        this.playerOwn.createDices(set1);
        this.playerOther.createDices(set2);

        this.duel = new Luts.Object.Duel(this.playerOwn,this.playerOther);

        var phase;
        do{
            phase = this.duel.update();
            if (phase === 3 && !noLog) {
                console.log('You Score: ' + this.duel.scoreOwn, 'Enemy Score: ' + this.duel.scoreOther);
                console.log('You: ' + this.duel.playerOwn.hp, 'Enemy: ' + this.duel.playerOther.hp);
            }
        }while(phase < 4);

        return (this.playerOwn.hp > 0);
    },
    matchMultiple: function (set1,set2,amount) {
        var won = 0;
        for(var i = 0; i< amount; i++){
            won += (this.match(set1,set2,true) ? 1 : 0);
        }
        return won/amount;
    },
    avgWinRate: function (d1,d2) {
        var dmax1 = Luts.Object.DuelHandler.maxLevelDiceType(Luts.Object.DuelHandler.dice[d1].d);
        var dmax2 = Luts.Object.DuelHandler.maxLevelDiceType(Luts.Object.DuelHandler.dice[d2].d);
        var winRate1 = this.matchMultiple([{d: d1,l:0}],[{d: d2, l:0}],100);
        var winRate2 = this.matchMultiple([{d: d1,l:0},{d: d1,l:0},{d: d1,l:0},{d: d1,l:0},{d: d1,l:0}],[{d: d2, l:0},{d: d2, l:0},{d: d2, l:0},{d: d2, l:0},{d: d2, l:0}],100);
        var winRate3 = 1 - this.matchMultiple([{d: d2,l: dmax2}],[{d: d1,l: dmax1}],100);
        var winRate4 = 1 - this.matchMultiple([{d: d2, l:dmax2},{d: d2, l:dmax2},{d: d2, l:dmax2},{d: d2, l:dmax2},{d: d2, l:dmax2}],[{d: d1,l:dmax1},{d: d1,l:dmax1},{d: d1,l:dmax1},{d: d1,l:dmax1},{d: d1,l:dmax1}],100);
        return {low: (winRate1 + winRate2)/2, high:(winRate3 + winRate4)/2};
    },
    avgWinRateTotal: function (d1) {
        var sumLow = 0;
        var sumHigh = 0;
        var count = 0;
        Luts.Object.DuelHandler.dice.forEach(function (d,i) {
            if(i !== d1){
                var winRate = this.avgWinRate(d1,i);
                var rare = Luts.Object.DuelHandler.rarityChance(Luts.Object.DuelHandler.dice[i].rarity);
                sumLow += winRate.low * rare;
                sumHigh += winRate.high * rare;
                count += rare;
            }
        }.bind(this));
        return {low: sumLow / count,high: sumHigh/count};

    },
    powerAll: function () {
        var normal = this.avgWinRateTotal(0);
        for(var i = 1; i < Luts.Object.DuelHandler.dice.length; i++){
            var d = Luts.Object.DuelHandler.dice[i];
            var awr = this.avgWinRateTotal(i);
            console.log('\n' + d.name);
            console.log('Low : ' + Phaser.Math.roundTo(awr.low / normal.low * 6,-1));
            console.log('High : ' + Phaser.Math.roundTo(awr.high / normal.high * 100,-1));
            //console.log('Avg : ' + Phaser.Math.roundTo((awr.high / normal.high + awr.low / normal.low)/2 * 6,-1));
        }
    },
};
Luts.Object.DuelDice = function(player,data,level){
    this.data = data;
    this.player = player;
    this.level = level;
    this.rnd = this.player.rnd;
    this.diceType = Luts.Object.DuelHandler.levelToDiceType(data.d,level);
    this.id = this.player.dices.length;
    this.level = level;

    this.min = 1;
    this.max = this.diceType;
    this.lastPoints = 0;
    this.lastScore = 0;

    this.onRoll = new Phaser.Signal();
    this.onUseSpecial = new Phaser.Signal();
};

Luts.Object.DuelDice.prototype.constructor = Luts.Object.DuelDice;

Luts.Object.DuelDice.prototype.setData = function(data,level){
    this.data = data;

    this.diceType = Luts.Object.DuelHandler.levelToDiceType(data.d,level);
    this.level = level;

    this.max = this.diceType;
};

Luts.Object.DuelDice.prototype.roll = function(result){
    this.lastScore = 0;
    var frac = Math.pow(this.rnd.frac(),1);
    var int = Math.floor(this.min + (frac * (this.max - this.min + 1)));
    if(result != null)
        int = result;
    this.lastPoints = int;
    this.lastScore = int * Luts.Object.DuelHandler.ascendMulti(this.data.d,this.level);
    this.onRoll.dispatch();
    return this.lastScore;
};

Luts.Object.DuelDiceImage = function(diceContainer, x, y,dice){
    var state = diceContainer.state;
    Phaser.Image.call(this, state.game, x, y);
    state.game.add.existing(this);
    this.game = state.game;
    this.state = state;
    this.dice = dice;
    this.data = dice.data;
    this.diceContainer = diceContainer;
    this.diceType = Luts.Object.DuelHandler.levelToDiceType(this.data.d,dice.level);
    this.id = this.diceContainer.dices.length;
    this.level = dice.level;

    this.min = 1;
    this.max = this.diceType;
    this.lastPoints = 0;
    this.lastScore = 0;

    this.tooltipContainer = this.game.add.image(0,0,'ingame','d6_6');
    this.tooltipContainer.anchor.set(0.5);
    this.tooltipContainer.alpha = 0;
    this.addChild(this.tooltipContainer);

    this.tt = new Luts.Object.Tooltip(state,this.tooltipContainer,Luts.Object.DuelHandler.getDesc(this.data,this.level));

    this.diceImageContainer = this.game.add.image(0, 0);
    this.diceImageContainer.anchor.set(0.5);
    this.addChild(this.diceImageContainer);

    this.shine = new Luts.Object.RarityShine(state,this.diceImageContainer,'rare');

    this.diceImage = this.game.add.image(0, 0, 'ingame');
    this.diceImage.anchor.set(0.5);
    this.diceImageContainer.addChild(this.diceImage);

    this.icon = this.game.add.image(0,0,'ingame');
    this.icon.anchor.set(0.5);
    this.icon.alpha = 0.75;
    this.diceImage.addChild(this.icon);

    this.game.add.tween(this.icon).to({alpha:0},this.game.rnd.between(900,1100),Phaser.Easing.Sinusoidal.InOut,true,0,-1,true);

    this.diceNumber = new Luts.Object.Text(this.state,0,0,'regular','1', 24);
    this.diceNumber.anchor.set(0.5);
    this.diceImage.addChild(this.diceNumber);

    this.pointsText = new Luts.Object.Text(this.state, 0, -60, 'regular', '', 18, '#ffffff');
    this.pointsText.anchor.set(0.5);
    this.addChild(this.pointsText);
    this.pointsText.alpha = 0;


    var plus = '+';

    this.plusText = new Luts.Object.Text(this.state, -60, -60, 'regular', (this.id > 0) ? plus : '', 32, '#000000');
    this.plusText.strokeThickness = 0;
    this.plusText.anchor.set(0.5);
    this.addChild(this.plusText);
    this.plusText.alpha = 0;

    this.setImage(1);

    this.diceContainer.dices.push(this);
    this.dice.onRoll.add(this.roll,this);

    this.dice.onUseSpecial.add(this.specialUseAnim,this)
};

Luts.Object.DuelDiceImage.prototype.constructor = Luts.Object.DuelDiceImage;
Luts.Object.DuelDiceImage.prototype = Object.create(Phaser.Image.prototype);

Luts.Object.DuelDiceImage.prototype.update = function () {
};

Luts.Object.DuelDiceImage.prototype.updateData = function(dice){
    this.dice = dice;
    this.data = dice.data;
    this.level = dice.level;
    this.diceType = Luts.Object.DuelHandler.levelToDiceType(this.data.d,dice.level);
    this.tt.setText(Luts.Object.DuelHandler.getDesc(this.data,this.level));
    if(this.data.rarity !=='common') {
        this.shine.frameName = 'rarity_' + this.data.rarity;
    }
    this.shine.visible = (this.data.rarity !=='common');


    if(this.data.icon) {
        this.icon.frameName = 'dd_' + this.data.icon;
    }
    this.icon.visible = this.data.icon;
};

Luts.Object.DuelDiceImage.prototype.specialUseAnim = function(){
    if(!Luts.isActive)
        return;
    if(this.parent) {
        this.scale.set(1);
        if (Luts.isActive) {
            this.game.add.tween(this.scale).from({x: 1.1, y: 1.1}, 1000, Phaser.Easing.Elastic.Out, true);
        }
    }else{
        this.dice.onUse.remove(this.specialUseAnim);
    }
};

Luts.Object.DuelDiceImage.prototype.roll = function(){
    if(this.parent)
        this.setImage(this.dice.lastPoints);
    else
        this.dice.onRoll.remove(this.roll);
};

Luts.Object.DuelDiceImage.prototype.setImage = function(i) {
    if (this.diceType === 6){
        var post = '';
        if (this.isMulti)
            post = 'm';
        this.diceImage.frameName = 'd' + this.diceType + '_' + i + post;
        this.diceNumber.visible = false;
    }else {
        this.diceImage.frameName = 'd' + this.diceType;
        this.diceNumber.setText(i);
        this.diceNumber.visible = true;
    }
};

Luts.Object.DuelDiceImage.prototype.playRollAnim = function (seconds) {
    this.pointsText.alpha = 0;
    this.plusText.alpha = 0;

    if (!Luts.isActive)
        return;

    if (this.rollAnim)
        this.rollAnim.stop();
    this.diceImageContainer.y = 0;
    this.diceImageContainer.angle = 0;
    var dly = this.game.rnd.between(0,seconds / 2);
    this.rollAnim = this.game.add.tween(this.diceImageContainer).from({y: -500}, seconds * 1000, Phaser.Easing.Bounce.Out,true,dly);
    this.game.add.tween(this.diceImageContainer).from({ angle: this.game.rnd.between(-360,360)}, seconds * 1000, Phaser.Easing.Back.Out,true, dly);

    this.rollAnim.onComplete.add(this.playScoreAnim,this);
};

Luts.Object.DuelDiceImage.prototype.playScoreAnim = function () {
    this.pointsText.alpha = 1;
    this.pointsText.setText(Luts.Format.Decimal(this.dice.lastScore));
    this.pointsText.scale.set(1);
    this.game.add.tween(this.pointsText.scale).from({x: 0, y: 0}, 500, Phaser.Easing.Elastic.Out,true);

    this.plusText.alpha = 1;
    this.plusText.scale.set(1);
    this.game.add.tween(this.plusText.scale).from({x: 0, y: 0}, 500, Phaser.Easing.Elastic.Out,true);
};
Luts.Object.DuelDicePlayer = function(rnd,name){
    this.rnd = rnd;
    this.diceName = name;
    this.dices = [];
    this.diceData = [];
    this.lastScore = 0;
    this.other = null;

    this.elo = 0;

    this.maxHp = 5;
    this.hp = 5;
    this.power = 0;

    this.poisoned = 0;

    this.lastComboMulti = 0;

    this.onCreateDice = new Phaser.Signal();
    this.onRoll = new Phaser.Signal();
    this.onDamage = new Phaser.Signal();
};

Luts.Object.DuelDicePlayer.prototype.constructor = Luts.Object.DuelDicePlayer;

Luts.Object.DuelDicePlayer.prototype.createDices = function(dices){
    this.diceData = dices;

    this.maxHp = 0;
    this.power = 0;
    this.dices.forEach(function (d) {
        d.enabled = false;
    });
    dices.forEach(function (d,i) {
        if(!this.dices[i]){
            var dObj = new Luts.Object.DuelDice(this,d.data,d.level);
            this.dices.push(dObj);
        }
        this.dices[i].enabled = true;
        this.dices[i].setData(d.data,d.level);

        this.maxHp += Luts.Object.DuelHandler.levelToDiceType(d.data.d,d.level) * Luts.Object.DuelHandler.ascendMulti(d.data.d,d.level);
        this.power += Luts.Object.DuelHandler.realPower(d.data,d.level);
    }.bind(this));
    this.hp = this.maxHp;

    this.onCreateDice.dispatch();
};

Luts.Object.DuelDicePlayer.prototype.afterRoll = function(){
    if (this.poisoned > 0){
        this.damage(this.poisoned);
        return true;
    }
    return false;
};

Luts.Object.DuelDicePlayer.prototype.damage = function(dmg){
    dmg = Math.ceil(this.handleDamageMod(dmg));

    this.hp = Phaser.Math.clamp(this.hp - dmg,0,this.maxHp);
    this.onDamage.dispatch(dmg);
    return dmg;
};

Luts.Object.DuelDicePlayer.prototype.poison = function(dmg){
    this.poisoned += dmg;
};

Luts.Object.DuelDicePlayer.prototype.rollAll = function(result){
    var total = Decimal(0);
    var values = [];
    var combosEnabled = true;
    var maxDicePoints = 0;
    this.dices.forEach(function(d,i){
        var value = d.roll(result && result[i]);
        total = total.add(value);
        values.push(d.lastPoints);
        maxDicePoints += d.diceType;
    }.bind(this));

    var dr = Luts.DiceRules(values);
    if (dr != Luts.DiceRules.Match.NOTHING && combosEnabled) {
        this.lastComboMulti = Decimal(Luts.DiceRules.getData(dr).multi).pow(Math.min(this.dices.length * 6,maxDicePoints) / (this.dices.length * 6));
        total = total.times(this.lastComboMulti);
    }
    this.lastValues = values;
    this.lastDiceMatch = dr;
    this.lastScore = total;
    this.onRoll.dispatch();
    return total;
};

Luts.Object.DuelDicePlayer.prototype.handleDamageMod = function (damage) {
    this.dices.concat(this.other.dices).forEach(function (d) {
        if (d && d.data.damageMod){
            var oldDamage = damage;
            damage = d.data.damageMod(d.lastPoints,this === d.player,damage);
            if(damage !== oldDamage)
                d.onUseSpecial.dispatch();
        }
    }.bind(this));
    return damage;
};


Luts.Object.DuelDiceContainer = function(state, x, y, player){
    Phaser.Image.call(this, state.game, x, y);
    state.game.add.existing(this);
    this.game = state.game;
    this.state = state;
    this.player = player;
    this.dices = [];

    this.rollAnim = 2;

    this.totalText = new Luts.Object.Text(state,0, -100,'regular', 100, 30);
    this.totalText.anchor.set(0.5);
    this.addChild(this.totalText);
    this.totalText.visible = false;

    this.bonusText = new Luts.Object.Text(state,-100,-120,'regular','100',32,'#ffffff');
    this.bonusText.angle = -25;
    this.bonusText.anchor.set(0.5);
    this.addChild(this.bonusText);
    this.bonusText.visible = false;

    this.infoText = new Luts.Object.Text(state,-450,-50,'text','',16,'#000000');
    this.infoText.strokeThickness = 0;
    this.addChild(this.infoText);

    this.dmgText = new Luts.Object.Text(state,-360,-40,'text','<c=#00ff00>WIN!',32);
    this.dmgText.anchor.set(0.5);
    this.addChild(this.dmgText);
    this.dmgText.alpha = 0;

    this.setText();

    this.player.onCreateDice.add(this.createDices,this);
    this.player.onRoll.add(this.rollAll,this);
    this.player.onDamage.add(this.damage,this);
};

Luts.Object.DuelDiceContainer.prototype.constructor = Luts.Object.DuelDiceContainer;
Luts.Object.DuelDiceContainer.prototype = Object.create(Phaser.Image.prototype);

Luts.Object.DuelDiceContainer.prototype.setText = function(){
    var text = this.player.diceName + '\nPower: ' + Luts.Format.Decimal(this.player.power) + '\nHealth: ' + this.player.hp + '/' +this.player.maxHp;
    if(this.player.elo)
        text += '\nElo: ' + this.player.elo;
    this.infoText.setText(text);
};

Luts.Object.DuelDiceContainer.prototype.damage = function(dmg){
    if(!Luts.isActive)
        return;
    this.dmgText.alpha = 1;
    this.dmgText.scale.set(1);
    this.game.add.tween(this.dmgText.scale).from({x: 0, y: 0}, 500, Phaser.Easing.Elastic.Out,true);

    this.dmgText.setText((dmg > 0 ? '<c=#ff0000>' : '<c=#00ff00>+') + Luts.Format.Decimal(-dmg));
    this.setText();
};

Luts.Object.DuelDiceContainer.prototype.createDices = function(){
    this.dices.forEach(function (d) {
        d.visible = false;
    });

    this.maxHp = 0;
    this.player.dices.forEach(function (d,i) {
        if(!d.enabled)
            return;
        if(!this.dices[i]) {
            var dObj = new Luts.Object.DuelDiceImage(this, -240 + i * 120, 0, d);
            dObj.anchor.set(0.5);
            this.addChild(dObj);
        }
        this.dices[i].visible = true;
        this.dices[i].updateData(d);
    }.bind(this));

    this.setText();
};

Luts.Object.DuelDiceContainer.prototype.rollAll = function(){
    this.dices.forEach(function(d){
        d.playRollAnim(this.rollAnim / 2);
    }.bind(this));

    this.dmgText.alpha = 0;

    Luts.Sound.play('dice',0.5);

    if (this.player.lastDiceMatch != Luts.DiceRules.Match.NOTHING) {
        this.playBonusAnim(this.player.lastDiceMatch);
    }
    this.playTotalAnim(this.player.lastScore);
};

Luts.Object.DuelDiceContainer.prototype.playBonusAnim = function(bonus) {
    if (!Luts.isActive || !this.state.duelVisible)
        return;
    if (this.bonusTween)
        this.bonusTween.stop();
    if (this.bonusTween2)
        this.bonusTween2.stop();
    if (this.bonusTween3)
        this.bonusTween3.stop();
    this.bonusText.visible = true;
    var b = Luts.DiceRules.getData(bonus);
    var color = '#ffffff';
    var size = 30;
    var shake = 0;
    var animSpeed = this.rollAnim / 2;
    var sound = '';
    this.bonusText.angle = -25;
    switch (b.effect){
        case 1:
            sound = 'success3';
            color = '#ffffff';
            size = 30;
            break;
        case 2:
            sound = 'success2';
            color = Luts.Config['colors']['yellow'];
            size = 35;
            this.bonusTween = this.game.add.tween(this.bonusText).from({angle: -35}, 250, Phaser.Easing.Sinusoidal.InOut,true,animSpeed * 1500,-1, true);
            shake = 0.005;
            break;
        case 3:
            sound = 'success4';
            color = Luts.Config['colors']['pink'];
            size = 45;
            this.bonusTween = this.game.add.tween(this.bonusText).from({angle: -35}, 125, Phaser.Easing.Sinusoidal.InOut,true,animSpeed * 1500,-1, true);
            shake = 0.01;
            break;
        case 4:
            sound = 'success5';
            color = Luts.Config['colors']['red'];
            size = 50;
            this.bonusTween = this.game.add.tween(this.bonusText).from({angle: -35}, 125, Phaser.Easing.Sinusoidal.InOut,true,animSpeed * 1500,-1, true);
            shake = 0.05;
            break;
        case 5:
            sound = 'success6';
            color = Luts.Config['colors']['red'];
            size = 150;
            this.bonusTween = this.game.add.tween(this.bonusText).from({angle: -35}, 125, Phaser.Easing.Sinusoidal.InOut,true,animSpeed * 1500,-1, true);
            shake = 0.1;
            break;
        default:
            break;
    }

    this.bonusText.scale.set(1);
    this.bonusTween2 = this.game.add.tween(this.bonusText.scale).from({x:0,y:0},animSpeed * 400,Phaser.Easing.Elastic.Out,true, animSpeed * 1500);
    this.bonusTween3 = this.game.add.tween(this.bonusText.scale).to({x:0,y:0}, 1000, Phaser.Easing.Back.In);
    this.bonusTween2.chain(this.bonusTween3);

    this.game.time.events.add(animSpeed * 1500,function () {
        Luts.Sound.play(sound,0.5);
    });


    if (this.state.enableScreenShake.value && shake > 0) {
        this.game.time.events.add(animSpeed * 1600, function () {
            this.game.camera.shake(shake, animSpeed * 500);
            this.game.camera.flash(Phaser.Color.hexToRGB(color), animSpeed * 250);
        }, this);
    }

    this.bonusText.setText('x' + Luts.Format.Decimal(this.player.lastComboMulti) + '\n<c='+color+'>' + b.displayName);
    this.bonusText.fontSize = size;
};

Luts.Object.DuelDiceContainer.prototype.playTotalAnim = function (total) {
    if (!Luts.isActive)
        return;
    if(this.totalAnim)
        this.totalAnim.stop();
    this.totalText.visible = true;

    this.totalText.setText(Luts.Format.Decimal(total));
    this.totalText.scale.set(1);
    this.totalAnim = this.game.add.tween(this.totalText.scale).from({x: 0, y: 0},this.rollAnim * 500/2, Phaser.Easing.Elastic.Out,true, this.rollAnim * 1500 / 2);
};
Luts.Object.RarityShine = function(state, obj, rarity){
    Phaser.Image.call(this, state.game, 0, 0, 'ingame','rarity_' + rarity);
    state.game.add.existing(this);
    this.game = state.game;
    this.state = state;

    this.anchor.set(0.5);
    obj.addChild(this);

    this.game.add.tween(this.scale).to({x:1.1,y:1.1},this.game.rnd.between(900,1100),Phaser.Easing.Sinusoidal.InOut,true,0,-1,true);
    this.game.add.tween(this).to({angle: 360},this.game.rnd.between(4900,5100),Phaser.Easing.Linear.None,true,0,-1);
};

Luts.Object.RarityShine.prototype.constructor = Luts.Object.RarityShine;
Luts.Object.RarityShine.prototype = Object.create(Phaser.Image.prototype);

Luts.Object.AdReward = function (handler,text,currency,chance,lock,minFunc,maxFunc,wonFunc) {
    this.handler = handler;
    this.state = handler.state;
    this.game = handler.game;
    this.text = text;
    this.currency = currency;
    this.chance = chance;
    this.lock = Luts.Lock.get(lock);
    this.minFunc = minFunc;
    this.maxFunc = maxFunc;
    this.wonFunc = wonFunc;

    if(this.lock){
        this.lock.onUnlocked.add(function () {
            new Luts.Object.Popup(this.state,"From now on you can receive " + this.text + " by watching 'Free Stuff' Ads!");
        }.bind(this))
    }
};

Luts.Object.AdReward.prototype.constructor = Luts.Object.AdReward;

Luts.Object.AdReward.prototype.normalizedChance = function(){
    return this.chance / this.handler.chanceSum();
};

Luts.Object.AdReward.prototype.getText = function () {
    var min = Decimal(this.minFunc());
    var max = Decimal(this.maxFunc());
    var minmax = Luts.Format.Decimal(min) + ' - ' + Luts.Format.Decimal(max);
    if(min.equals(max))
        minmax = Luts.Format.Decimal(min);

    return Math.round(this.normalizedChance() * 100) + "%:  "  + minmax + ' ' +this.text;
};
Luts.Object.AdRewardHandler = function (state) {
    this.state = state;
    this.game = this.state.game;
    this.adRewards = [];
    this.availableAs = Luts.Store.getItem('availableAds',0);
    this.lastFreeStuffAd = Math.max(Math.min(Luts.Store.getItem('lastFreeStuff',Date.now()),Date.now()), Date.now() - 1000 * 60 * 4);
};

Luts.Object.AdRewardHandler.prototype.constructor = Luts.Object.AdRewardHandler;

Luts.Object.AdRewardHandler.prototype.init = function(button) {
    this.adButton2 = button;
    this.adButton2.subtitle.setText('Watch Ad(' + this.availableAs + ')');
    this.adButton2.subtitle.scale.set(0.9);
    button.callback = this.clickFreeStuffForAd.bind(this);

    this.addReward("Money",0,45,null,function () {
        var money = Decimal.max(Luts.Upgrades.currency[0].dividedBy(100), this.state.averagePerSecond());
        var interval = this.state.rollInterval.modValue().toNumber() + this.state.rollAnim.modValue().toNumber();
        return money.times(60 * 2).dividedBy(interval);
    }.bind(this),function () {
        var money = Decimal.max(Luts.Upgrades.currency[0].dividedBy(100), this.state.averagePerSecond());
        var interval = this.state.rollInterval.modValue().toNumber() + this.state.rollAnim.modValue().toNumber();
        return money.times(60 * 15).dividedBy(interval);
    }.bind(this));

    this.addReward("BP",6,20,null,function () {return 1;}, function () {return 6;});

    this.addReward("Luck",3,30,'decks',function () {
        var luck = this.state.luckUpgrades[0].price;
        this.state.luckUpgrades.forEach(function (u) {
            if (u.price.lessThan(luck) && Luts.Upgrades.isBelowMaxLevel(u))
                luck = u.price;
        });
        return luck;
    }.bind(this),function () {
        var luck = this.state.luckUpgrades[0].price;
        this.state.luckUpgrades.forEach(function (u) {
            if (u.price.lessThan(luck) && Luts.Upgrades.isBelowMaxLevel(u))
                luck = u.price;
        });
        return luck.times(2);
    }.bind(this));

    this.addReward("Skill Point",5,5,'goldenDeck',function () {return 1;}, function () {return 1;},function (r) {
        Luts.Value.get('bsp').add(r);
    });
};

Luts.Object.AdRewardHandler.prototype.update = function(){
    this.adTimeFreeStuff = Date.now() - this.lastFreeStuffAd;
    var timeDif = this.adTimeFreeStuff - 1000 * 60 * 4;
    if(timeDif > 0){
        this.lastFreeStuffAd = Date.now();
        this.availableAs = Math.min(4,this.availableAs + Math.ceil(timeDif / (1000 * 60 * 4)));
        Luts.Store.setItem('availableAds',this.availableAs);
        Luts.Store.setItem('lastFreeStuff',this.lastFreeStuffAd);
        this.adButton2.subtitle.setText('Watch Ad(' + this.availableAs + ')');
    }
    if(this.availableAs > 0  && !Luts.Ad.requested){
        this.adButton2.setActive(true,true);
        this.adButton2.visible = true;
    }else{
        this.adButton2.setActive(false);
        this.adButton2.visible = false;
    }
};

Luts.Object.AdRewardHandler.prototype.requestAdPopup = function(text,callback){
    if(Luts.adsEnabled || Luts.DEBUG) {
        var popup = new Luts.Object.Popup(this.state, text, true, function (yes) {
            if (yes)
                callback();
        }.bind(this));
        var mtxButton = new Luts.Object.MtxButton(this.state,0,75,'0noads','Do you want to disable Ads? You will get the Point Multiplier, free spin and free stuff without watching an Ad forever',true);
        popup.yesButton.y -= 50;
        popup.noButton.y -= 50;
        popup.text.y -= 25;
        popup.text.scale.set(0.9);
        popup.addChild(mtxButton);
    }else{
        callback();
    }
};

Luts.Object.AdRewardHandler.prototype.addReward = function(text,currency,chance,lock,minFunc,maxFunc,wonFunc){
    var reward = new Luts.Object.AdReward(this,text, currency, chance, lock, minFunc, maxFunc,wonFunc);
    this.adRewards.push(reward);
};

Luts.Object.AdRewardHandler.prototype.chanceSum = function(){
    var sum = 0;
    this.adRewards.forEach(function (ar) {
        if(!ar.lock || ar.lock.unlocked)
            sum += ar.chance;
    });
    return sum;
};

Luts.Object.AdRewardHandler.prototype.getPopupText = function(){
    var text = "Watch an Ad to get one of the following:";
    this.adRewards.forEach(function (ar) {
        if(!ar.lock || ar.lock.unlocked)
            text += '\n' + ar.getText();
    });
    return text;
};

Luts.Object.AdRewardHandler.prototype.getWeights = function(){
    var ret = [];
    this.adRewards.forEach(function (ar) {
        if(!ar.lock || ar.lock.unlocked)
            ret.push(ar.chance);
        else
            ret.push(0);
    });
    return ret;
};

Luts.Object.AdRewardHandler.prototype.clickFreeStuffForAd = function () {
    this.requestAdPopup(this.getPopupText(),function (){
        var rnd = this.game.rnd.frac();
        this.setAdButton2Text();
        this.adFreeReceive = this.adFreeMin.add(this.adFreeMax.minus(this.adFreeMin).times(rnd)).round();
        this.requestAdForFreeStuff('Thank you! You received ' + Luts.Format.Decimal(this.adFreeReceive) + ' ' + this.adFreeName,this.adFreeId,this.adFreeName);
    }.bind(this));
};
Luts.Object.AdRewardHandler.prototype.setAdButton2Text = function () {
    var index = Luts.Util.RandomWeight(this.state.game.rnd.frac(),this.getWeights());
    this.adFreeMin = Decimal(this.adRewards[index].minFunc());
    this.adFreeMax = Decimal(this.adRewards[index].maxFunc());
    this.adFreeCurrencyId = this.adRewards[index].currency;
    this.adFreeName = this.adRewards[index].text;
    this.wonFunc = this.adRewards[index].wonFunc;
};

Luts.Object.AdRewardHandler.prototype.requestAdForFreeStuff = function(thankstext,name){
    var adId = 'freeStuff';
    Luts.Events.onAdEnded.addOnce(function (success2) {
        if (success2) {
            this.availableAs -= 1;
            Luts.Store.setItem('availableAds',this.availableAs);
            this.adButton2.subtitle.setText('Watch Ad(' + this.availableAs + ')');
            Luts.Appsflyer.trackAd(name);
            Luts.Upgrades.changeCurrency(this.adFreeCurrencyId,this.adFreeReceive);
            if(this.wonFunc)
                this.wonFunc(this.adFreeReceive);
            new Luts.Object.Popup(this.state,thankstext);
        }else {
            new Luts.Object.Popup(this.state, 'No Ad available, try again later');
            this.adButton2.setActive(true);
            this.adButton2.visible = true;
        }
    },this);
    Luts.Ad.requestAd(adId);
    this.adButton2.setActive(false);
    this.adButton2.visible = false;
};

Luts.Object.TutorialText = function(state, x, y){
    Phaser.Image.call(this, state.game, x, y, "");
    state.game.add.existing(this);
    this.game = state.game;
    this.state = state;

    this.text = new Luts.Object.Text(state,x,y,'text','Hello',16,'#000000');
    this.text.strokeThickness = 0;
    this.addChild(this.text);
    this.text.wordWrapWidth = 200;
    this.text.anchor.set(0,0.5);

    this.step = Luts.Store.getItem('tutStep',0);
    this.updateText();

    if(Luts.Store.getItem('activePlaytime') > 120 && this.step == 0){
        this.destroy();
        return;
    }

    Luts.Events.onCurrencyChanged[0].add(function () {
        if(this.step == 0) {
            this.step = 1;
            this.updateText();
        }
        else if(this.step == 1) {
            if(Luts.Upgrades.currency[0].greaterThanOrEqualTo(10)){
                this.step = 2;
                this.updateText();
            }
        }
    },this);

    Luts.Upgrades.get('main0value').onUpgrade.add(function(u,l){
        if(this.step == 2 && u.level >= 10){
            this.step = 3;
            this.updateText();
        }
        if(this.step == 5 && (u.level >= 100 || Luts.Value.get('main0_ascNum').modValue().greaterThan(0))){
            this.step = 6;
            this.updateText();
        }

    },this);

    Luts.Upgrades.get('main1value').onUpgrade.add(function(u,l){
        if(this.step == 3){
            this.step = 4;
            this.updateText();
        }
    },this);
    Luts.Upgrades.get('pair_multi').onUpgrade.add(function(u,l){
        if(this.step == 4){
            this.step = 5;
            this.updateText();
        }
    },this);

    Luts.Events.onCurrencyChanged[1].add(function () {
        if(this.step == 6) {
            this.step = 7;
            this.updateText();
        } else if(this.step == 7){
            this.step = 8;
            this.updateText();
        }

    },this);
};

Luts.Object.TutorialText.prototype.constructor = Luts.Object.TutorialText;
Luts.Object.TutorialText.prototype = Object.create(Phaser.Image.prototype);

Luts.Object.TutorialText.prototype.update = function () {

};

Luts.Object.TutorialText.prototype.updateText = function () {
    Luts.Store.setItem('tutStep',this.step);
    switch (this.step) {
        case 0:
            this.text.setText('Welcome to Idle Dice!\nStart by tapping "Roll"');
            break;
        case 1:
            this.text.setText('You gained Points!\nThe higher you roll the more points you will get.\nKeep rolling until you have enough to upgrade the dice!');
            break;
        case 2:
            this.text.setText('You have enough Points to Upgrade!\nWith every Level the points of the dice rolls multiply!\nTry to upgrade your dice to level 10.');
            break;
        case 3:
            this.text.setText('Good job. You\'re making a lot of points already.\nKeep making points until you can buy a second dice!');
            break;
        case 4:
            this.text.setText('If both dice roll the same number you get even more points!\nUse the menu on the left to upgrade the multiplier you get for combos!');
            break;
        case 5:
            this.x = -260;
            this.text.setText('Keep rolling and upgrading to get more points!\nAre you able to get a dice to level 100?');
            break;
        case 6:
            this.x = -260;
            this.text.setText('Ascending a dice brings it back to level 1 but with a 100x multiplier!');
            break;
        case 7:
            this.x = -260;
            this.text.setText('Everytime you ascend dice you get closer to your next card draw.\nYou can chose between 3 random cards every time.\nEvery card gives a powerful bonus!');
            break;
        case 8:
            this.text.setText('');
            break;
        default:
            this.text.setText('');
    }
};